var glossary_namespaceObject = JSON.parse('{"onetoone_auth":{"name":"1:1 인증","description":"사용자 자신을 확인받는 인증 방법입니다. 개인의 바이오 정보와 데이터베이스에 저장된 바이오 정보를 일대일로 비교하여 검증합니다."},"onetomany_auth":{"name":"1:N 인증","description":"데이터베이스에서 사용자 정보를 찾아내는 인증 방법입니다. 개인의 바이오 정보와 등록된 모든 데이터베이스의 정보를 비교하여 식별하는 방식입니다."},"acid":{"name":"ACID 특성","description":"데이터베이스에 대하여 <b>원자성(Atomic)</b>, <b>일관성(Consistent)</b>, <b>고립성(Isolated)</b>, <b>영속성(Durable)</b>을 가져야하는 트랜잭션의 특성입니다. <ul><li><b>원자성</b>은 더 이상 분류할 수 없는 작업 단위로서 트랜잭션 내에 모든 단계에서 모두 성공하거나 실패해야 하는 특성</li><li><b>일관성</b>은 데이터베이스를 하나의 안정된 상태에서 다른 안정된 상태로 가져가야 하는 특성</li><li><b>고립성</b>은 임의의 트랜잭션이 동시에 실행되는 다른 트랜잭션에 영향을 주어서는 안 되는 특성</li><li><b>영속성</b>은 데이터베이스의 무결성을 유지하기 위해 재구성될 수 있도록 로그를 드라이브에 유지해야 하는 특성</li><ul>"},"ad_hoc":{"name":"Ad Hoc 네트워크","description":"기지국이나 엑세스 포인트와 같은 네트워크 기반 구조에 의존하지 않고 각각의 장치들에 의해 자율적으로 구성되는 네트워크입니다. 각 장치들은 무선 인터페이스로 통신하지만 라우팅 기능으로 무선 통신의 거리상 제약을 극복하며, 각 장치들의 이동이 자유롭기 때문에 동적이고 자율적인 네트워크 토폴로지를 형성할 수 있습니다."},"ansi378":{"name":"ANSI 378","description":"미국 규격 협회(American National Standards Institute, ANSI)에서 정의한 지문 템플릿 표준입니다."},"dhcp":{"name":"DHCP","description":"동적 호스트 설정 통신 규약(Dynamic Host Configuration Protocol, DHCP)은 TCP/IP 통신을 위해 필요한 설정 정보를 자동으로 할당하고 관리하기 위한 통신 규약입니다."},"dip_switch":{"name":"DIP 스위치(Dual-inline Package Switch)","description":"하드웨어 변경 없이 사용자가 회로 기판상에서 기능을 임의로 선택할 수 있는 On-Off 스위치입니다."},"fail_safe_lock":{"name":"Fail Safe Lock","description":"전원이 끊기면 안전 상태로 전환하는 장금 장치입니다. 화재 등으로 출입문에 공급되는 전원이 끊겼을 때 잠금이 해제되어 출입문을 개방하도록 설계되었습니다."},"fail_secure_lock":{"name":"Fail Secure Lock","description":"전원이 끊겼을 때 문이 자동 잠기는 보안 상태로 전환하는 잠금 장치입니다. 은행과 같이 보안이 중요한 장소에서 전원이 끊겼을 때 출입문을 잠가 보안을 유지하도록 설계되었습니다."},"fastcgi":{"name":"FastCGI","description":"웹 서버와 프로그램 간 데이터 교환을 위한 프로토콜입니다. 기존의 공통 게이트웨이 인터페이스(Common Gateway Interface, CGI)를 개선하여, 하나의 프로세스가 여러 CGI 요청을 처리할 수 있도록 설계되어 성능을 크게 향상시킨 인터페이스입니다."},"hf_card":{"name":"HF 카드","description":"데이터 읽기와 쓰기가 모두 가능한 13.56MHz 대역의 전자식 카드로, 스마트 카드의 한 종류입니다. 특정 리더만 읽을 수 있도록 설정하거나 데이터를 암호화하는 등 다양한 보안 기능을 적용할 수 있습니다."},"http":{"name":"HTTP(HyperText Transfer Protocol)","description":"웹 브라우저를 이용해 웹 클라이언트와 웹 서버가 데이터를 주고받는 프로토콜을 의미합니다."},"https":{"name":"HTTPS(HyperText Transfer Protocol over Secure Socket Layer)","description":"HTTP보다 보안이 강화된 형태의 프로토콜을 의미합니다. HTTPS에서 주고받는 모든 데이터는 암호화 단계를 거치기 때문에 HTTP에 비해 뛰어난 보안성을 갖습니다."},"ic_card":{"name":"IC 카드","description":"반도체 기반의 집적 회로를 내장한 카드로, 스마트 카드의 한 종류입니다. 데이터 읽기와 쓰기가 가능하며, 마그네틱 카드에 비해 더 큰 저장 용량과 뛰어난 내구성을 제공합니다. 자석과의 접촉에도 데이터 손상이 없으며, 특정 규격의 리더와 호환되도록 설정하거나 데이터를 암호화하는 등 다양한 보안 기능을 지원하여 높은 보안성과 기능성을 갖추고 있습니다."},"ik_rating":{"name":"IK(Impact Protection) 등급","description":"물리적 충격에 대한 제품 보호 정도를 규정한 국제 등급입니다. \'K\'는 Kinetic을 의미합니다."},"io":{"name":"I/O","description":"입력(Input)과 출력(Output)의 약어입니다. 컴퓨터 및 주변 장치에서 데이터를 전송하는 프로그램, 운영 또는 장치를 의미합니다."},"ip_rating":{"name":"IP(Ingress Protection) 등급","description":"고체 및 액체에 대한 제품 보호 정도를 규정한 국제 등급입니다."},"iso19749-2":{"name":"ISO 19749-2","description":"지문의 세밀한 특징점을 이용하여 지문 정보를 표현한 ISO 국제 지문 데이터 형식입니다. 자세한 내용은 <a href=\'https://www.iso.org/standard/50864.html\' target=_blank>다음 링크</a>를 참고하세요."},"json":{"name":"JSON(JavaScript Object Notation)","description":"데이터를 저장하고 전송하기 위한 간단한 문자 기반의 표준 포맷입니다. 복잡한 객체들의 관계를 문자, 괄호, 기호만으로 표현할 수 있으며, PHP, C#, Python 등 많은 프로그래밍 언어에서 사용할 수 있습니다."},"lan":{"name":"LAN","description":"근거리 통신망(Local Area Network, LAN)은 건물과 같은 한정된 지역 내에 위치한 컴퓨터, 프린터, 기타 장치 등을 통신선으로 연결하여 상호 작용할 수 있는 망 시스템입니다. LAN은 일반적으로 이더넷 케이블을 사용하여 연결되며, Wi-Fi와 같은 무선 통신망도 포함됩니다."},"lf_card":{"name":"LF(Low Frequency) 카드","description":"120~140kHz 대역을 사용하는 낮은 주파수(저주파)의 전자식 카드입니다."},"nc":{"name":"NC(Normally Closed)","description":"보통의 상태에서는 릴레이가 닫혀 있으나 장치가 작동하면 열리는 동작을 의미합니다. 초기에 릴레이가 닫혀 있기 때문에 연결된 회로에 전류가 흐릅니다."},"no":{"name":"NO(Normally Open)","description":"보통의 상태에서는 릴레이가 열려 있으나 장치가 작동하면 닫히는 동작을 의미합니다. 초기에 릴레이가 열려 있기 때문에 연결된 회로에 전류가 흐르지 않습니다."},"nvr":{"name":"NVR(Network Video Record)","description":"네트워크 상에 설치된 카메라나 비디오 장비를 통해 전달된 영상을 녹화하거나 모니터링하고, 발생된 이벤트를 관리할 수 있는 기능입니다."},"osdp":{"name":"OSDP(Open Supervised Device Protocol)","description":"리더(Reader)에서 컨트롤러로의 단방향 통신만 가능했던 Wiegand 인터페이스를 보완하여 개발된 RS-485 표준 프로토콜입니다. 리더(Reader)와 컨트롤러 간 양방향 통신 환경에서 대규모 데이터를 처리할 수 있으며, 바이오메트릭 데이터도 전송할 수 있습니다. 이 프로토콜을 지원할 경우 타사 장치와도 연결할 수 있기 때문에 기존 구성된 시스템에서 교체가 필요한 항목만 바꿔 사용할 수 있습니다."},"poe":{"name":"PoE(Power over Ethernet)","description":"이더넷 케이블을 통해 장치에 전원을 공급하는 시스템입니다. 하나의 케이블을 이용해 장치에 데이터를 전송하고 전원을 공급할 수 있기 때문에 설치와 확장이 간편하며, 배선 비용을 절감할 수 있습니다."},"rest":{"name":"REST(Representational State Transfer)","description":"웹 기반 시스템에서 자원을 정의하고 이를 HTTP 메서드(GET, POST, PUT, DELETE 등)를 통해 처리하는 아키텍처 스타일입니다. 간단하고 일관된 인터페이스를 제공하여 클라이언트와 서버 간의 상호작용을 효율적으로 만듭니다."},"rf":{"name":"RF(Radio Frequency)","description":"라디오 주파수를 의미하며, 원거리 또는 근거리에서 정보를 인식하거나 전송하기 위해 사용하는 전자기파입니다. 주로 통신, RFID 기술, 무선 네트워크 등 다양한 분야에서 활용됩니다."},"rfid":{"name":"RFID(Radio-Frequency Identification)","description":"RF(Radio Frequency)를 이용해 ID를 인식하고 식별하는 기술입니다. 안테나와 칩으로 구성된 RFID 태그에 정보를 저장하며, 이를 RFID 리더로 판독하여 정보를 식별합니다."},"rfid_tag":{"name":"RFID(Radio-Frequency Identification) 태그","description":"카드 등의 사물에 부착하여 사람이나 사물의 고유 식별 정보를 저장하는 전자 태그입니다. RFID 리더는 전파를 이용해 태그에 저장된 정보를 무선으로 인식합니다. RFID 태그는 일반적으로 소형 프로세서, 메모리, 소형 안테나, 배터리 등으로 구성되며 읽기 및 쓰기 여부, 전지 내장 여부, RF(Radio Frequency) 주파수 대역 등에 따라 여러 종류로 구분할 수 있습니다."},"rte":{"name":"RTE(Request To Exit) 버튼","description":"내부에서 출입문을 열기 위한 버튼입니다. 이 버튼을 누르면 출입문이 열리며, 퇴실할 때 별도의 인증이 필요하지 않은 출입문이나 구역에서 사용할 수 있습니다."},"rs485":{"name":"RS-485","description":"홈 네트워크를 지원하는 일종의 시리얼 통신 프로토콜 표준 규격입니다. RS-232는 전송 속도가 낮고 전송거리가 짧은 반면, RS-485는 긴 전송 거리와 높은 신뢰성을 제공합니다. 모든 장치가 하나의 통신 라인에서 데이터를 전송하고 수신할 수 있습니다."},"ssl":{"name":"SSL(Secure Socket Layer)","description":"웹 클라이언트와 웹 서버가 네트워크로 통신할 때 보안과 데이터 무결성을 위해 사용하는 암호 규약을 의미합니다."},"tcpip":{"name":"TCP/IP","description":"전송 제어 프로토콜/인터넷 프로토콜(Transmission Control Protocol/Internet Protocol, TCP/IP)은 컴퓨터 간 통신 프로토콜입니다. TCP는 데이터 전송을 위한 프로토콜, IP는 네트워크 주소를 지정하는 프로토콜입니다. TCP/IP는 인터넷과 같은 대규모 네트워크에서 데이터를 전송하는 데 사용합니다."},"tls":{"name":"TLS(Transport Layer Security)","description":"웹 클라이언트와 웹 서버가 네트워크로 통신할 때 보안과 데이터 무결성을 위해 사용하는 암호 규약을 의미합니다."},"uhf":{"name":"UHF(Ultra High Frequency)","description":"극초단파(Ultra High Frequency)는 주파수가 300~3,000MHz에 속하는 전자기파입니다. 위성방송, 휴대전화 등의 이동 통신, 지상파 디지털 TV, 항공 무선, RFID 기술 등 다양한 통신 분야에서 사용합니다. 높은 주파수로 인해 1~10cm의 짧은 파장을 가지며, 직진성이 강한 특징이 있습니다."},"voip":{"name":"VoIP(Voice over Internet Protocol)","description":"인터넷 프로토콜(Internet Protocol, IP) 망을 기반으로 음성 통화를 제공하는 통신 기술입니다. VoIP는 음성을 디지털 신호로 변환하여 인터넷을 통해 전송하며, 일반 전화망보다 저렴한 비용으로 통화할 수 있습니다."},"wiegand":{"name":"Wiegand","description":"Wiegand는 두 개의 신호선(DATA0, DATA1)을 사용하여 데이터를 전송하는 통신 방식입니다. 주로 출입 통제 시스템에서 리더(Reader)와 컨트롤러 간의 통신에 사용되며, 간단한 구조와 낮은 비용으로 구현할 수 있습니다. 다만, 전송 거리가 짧고 데이터 전송 속도가 느린 한계가 있습니다."},"import":{"name":"가져오기","description":"다른 컴퓨터 시스템 또는 프로그램에서 데이터를 자신의 시스템으로 읽어오는 것을 의미합니다."},"audit_trail":{"name":"감사 추적","description":"시스템의 변경 정보를 기록한 정보입니다. 사용자의 허가되지 않은 행위, 사용자 행위의 처리 과정, 등에 대한 정보를 조사할 수 있습니다."},"forced_open":{"name":"강제 문 열림","description":"사용자 인증이나 퇴실 버튼과 같은 정상적인 출입 이벤트 없이, 출입문 센서가 문 열림 상태를 감지한 경우입니다."},"private_auth":{"name":"개별 인증","description":"관리자가 지정한 크리덴셜 조합에 따라 사용자를 인증하는 방식으로 다른 인증 방식보다 우선합니다."},"pin":{"name":"개인 식별 번호(Personal Identification Number, PIN)","description":"본인을 증명하기 위해 개인에게 부여하는 개별 식별 번호입니다."},"alert":{"name":"경보","description":"시스템에서 발생한 알람(Alarm) 이벤트를 실시간으로 보여주거나 전달하는 동작입니다."},"arm":{"name":"경비 개시","description":"범죄 및 안전사고 예방용으로 특정 지역을 감시하는 동작입니다. 보안 시스템을 통하여 24시간 감시, 경보 알림, 녹화 등을 할 수 있습니다."},"intrusion_alarm_zone":{"name":"경비 구역","description":"경비 개시 후 허가받지 않은 사람이 침입을 시도하면 경고음을 출력하거나 릴레이 신호를 출력하도록 설정한 구역입니다. 주로 업무 종료 이후 경비를 개시하며, 경비 개시 이후 출입을 시도하면 설정된 알람이나 신호를 출력합니다."},"disarm":{"name":"경비 해제","description":"특정 지역에 대한 경보 시스템 가동을 중지하는 동작입니다."},"zone":{"name":"구역","description":"출입 규칙의 적용 대상이 되는 장치 그룹입니다. 이벤트를 모니터링하기 위해 사용합니다."},"aes":{"name":"고급 암호 표준(Advanced Encryption Standard, AES)","description":"미국 국립 표준 기술 연구소(National Institute of Standards and Technology, NIST)가 만든 데이터 암호화 표준(Data Encryption Standard, DES)을 대신할 차세대 국제 표준 암호 알고리즘입니다."},"administrator":{"name":"관리자","description":"모든 설정 권한을 가진 사용자입니다."},"optical_fp_sensor":{"name":"광학식 지문 센서","description":"빛을 이용하여 지문 정보를 검출하는 센서입니다."},"graphic_map":{"name":"그래픽 맵","description":"BioStar에서 제공하는 모니터링 방식의 하나로, 도면상에서 출입문의 상태를 실시간으로 확인하고 제어할 수 있는 기능입니다."},"nfc":{"name":"근거리 무선 통신(Near Field Communication, NFC)","description":"모바일 단말기에 탑재하여 근거리에서 양방향 데이터 송수신을 지원하는 RFID 기술입니다. 스마트폰 보급률이 늘어남에 따라 금융, 통신 등 다양한 분야에 이용되며, 출입통제 분야에서도 모바일 ID 카드의 형태로 활용되고 있습니다."},"tna":{"name":"근태","description":"출근과 결근을 포함하여 직원의 근무 시간에 관한 정보를 수집 및 추적하는 관리 기능입니다."},"tna_rule":{"name":"근태 규칙","description":"직원들이 근무한 시간을 파악하고 관리하기 위해 관리자가 정의한 규칙입니다."},"tna_event":{"name":"근태 이벤트","description":"직원의 근태 상황을 나타내는 이벤트입니다. 직원들의 출입 시간을 기록하여 특정 기간 근무한 시간을 계산합니다."},"global_zone":{"name":"글로벌 구역","description":"서버와 마스터 장치가 TCP/IP로 연결되고, 마스터 장치와 슬레이브 장치가 RS-485 통신으로 연결되어 통신하는 구역입니다. 해당 구역의 마스터 역할을 서버가 수행합니다."},"payroll_sys":{"name":"급여 시스템","description":"직원의 근무 시간 및 근태, 기타 세금 등의 요인에 따라 총임금을 계산하여 정확한 급여를 지급하기 위한 시스템입니다."},"export":{"name":"내보내기","description":"특별한 형식의 데이터를 사용하는 프로그램이 자신의 데이터를 다른 프로그램이 사용할 수 있는 형태로 저장하는 동작입니다."},"noise":{"name":"노이즈(Noise)","description":"신호를 모호하게 하거나 식별하기 어렵게 만드는 전기적 신호입니다."},"direct_mode":{"name":"다이렉트 모드(Direct mode)","description":"BioStar 클라이언트에서 연결할 수 있는 장치를 직접 검색하여 연결하는 방식입니다. 클라이언트에서 장치 및 서버와의 통신을 담당합니다. 서버에서 장치를 검색하면 연결할 수 있는 장치 목록이 나타나며, 관리자는 해당 목록에서 연결할 장치를 선택할 수 있습니다."},"diode":{"name":"다이오드","description":"전류가 한쪽 방향으로만 흐르도록 제어하는 부품입니다. 도어락이 동작할 때 순간적으로 발생하는 역전류를 방지하기 위해 사용합니다."},"short":{"name":"단락","description":"전선이 합선된 상태입니다. 일반적으로 전선의 손상이나 과전류로 인해 발생합니다."},"open":{"name":"단선","description":"전선이 끊어져 회로가 개방된 것으로, 전류가 흐르지 않는 상태입니다."},"bandwidth":{"name":"대역폭","description":"특정한 기능을 수행할 수 있는 주파수의 범위로, 헤르츠(Hz) 단위로 측정합니다. 일정 시간 동안 전선 또는 다른 매체를 통해 전송할 수 있는 정보의 양입니다. 주파수의 대역폭이 클수록 특정 시간 동안 더 많은 정보를 전송할 수 있습니다."},"dummy_reader":{"name":"더미 리더(Dummy Reader)","description":"사용자 데이터 저장이나 판단은 수행하지 않으며, 얼굴, 지문 및 카드 등 크리덴셜 데이터를 읽어 컨트롤 장치로 전송하는 역할만을 수행하는 장치입니다."},"daisy_chain":{"name":"데이지 체인(Daisy Chain)","description":"데이지 체인이란 연속적으로 연결된 하드웨어 장치들의 구성을 의미합니다."},"dbms":{"name":"데이터베이스 관리 시스템(DataBase Management System, DBMS)","description":"데이터베이스를 조작하는 소프트웨어입니다. 데이터베이스 관리 시스템이 데이터베이스를 관리하며, 응용 프로그램이나 사용자가 데이터베이스에 접근하여 데이터를 사용할 수 있도록 합니다."},"door_contact":{"name":"도어 컨택(Door Contact)","description":"출입문 센서의 다른 말입니다. 출입문의 현재 상태(닫힘/열림)를 확인하기 위한 자기 센서입니다."},"synchronization":{"name":"동기화","description":"서로 다른 시스템이나 네트워크에서 시간이나 정보 등을 일치시키는 동작입니다."},"eer":{"name":"동일 오류율(Equal Error Rate, EER)","description":"바이오 인식 성능의 지표이며, 타인 수락률(오인식률)과 본인 거부율(오거부율)이 일치하는 지점의 타인 수락률(오인식률)입니다. 일반적으로 낮은 동일 오류율을 가진 장치가 정확합니다."},"enrollment":{"name":"등록","description":"사용자의 바이오 정보를 바이오 인식 시스템에 저장하기 위한 일련의 절차입니다. 샘플 수집, 템플릿 생성 및 저장 등이 해당합니다."},"log":{"name":"로그(Log)","description":"시스템, 네트워크, 장치, 출입문 등에서 발생하는 모든 이벤트의 기록입니다."},"local_zone":{"name":"로컬 구역","description":"장치 간 RS-485 통신을 이용해 설정한 구역으로, 해당 구역의 마스터 역할을 서버가 아닌 마스터 장치가 수행합니다."},"relay":{"name":"릴레이(Relay)","description":"전기 회로의 개폐를 다른 전기 회로의 전류, 전압, 주파수 등의 변화에 따라 자동으로 실행하는 제어 기기입니다."},"mag_card":{"name":"마그네틱 카드","description":"자기 테이프의 자성을 변화시켜 데이터를 저장하는 카드입니다. 카드 한쪽 면의 자기 테이프를 카드 단말기에 읽어들여 데이터를 전송합니다. 용량이 적고 제한된 종류의 데이터만 저장할 수 있으며, 자석과 접촉하면 기록된 데이터가 변형되거나 손상될 수 있습니다. 또한, 데이터를 암호화하지 않기 때문에 보안성이 낮아 출입통제 분야뿐만 아니라 다양한 분야에서 IC 카드로 교체되는 추세입니다."},"master_device":{"name":"마스터(Master) 장치","description":"RS-485로 연결한 장치 중 컨트롤러 역할을 수행하는 장치입니다. 슬레이브 장치를 주기적으로 모니터링하여 데이터를 처리합니다. 호스트(Host) 장치라고도 부릅니다."},"matching_timeout":{"name":"매칭 타임아웃(Matching Timeout)","description":"장치 혹은 서버 매칭에 주어지는 제한 시간입니다. 시간 내에 매칭이 완료되지 않을 경우 매칭을 실패합니다."},"man_trap":{"name":"맨트랩(Mantrab)","description":"부정 출입을 방지하고 비보안 영역과 보안 영역을 분리하기 위한 물리적 출입통제 시스템입니다."},"multi_rfid":{"name":"멀티 RFID 카드 기술","description":"125kHz, 13.56MHz와 같이 서로 다른 대역 주파수의 카드를 하나의 장치에서 읽을 수 있는 기술입니다."},"message_timeout":{"name":"메시지 표시 타임아웃","description":"사용자의 조작이 없을 때 메시지가 화면에 표시되는 시간입니다."},"monitoring":{"name":"모니터링(Monitoring)","description":"특정 목적을 위한 감시 활동입니다. 출입통제 및 근태관리에서 모니터링은 출입통제 및 사용자의 근태 이벤트를 확인하거나 장치 및 출입문, 구역의 상태를 실시간으로 확인하고 제어하는 것을 의미합니다."},"model_number":{"name":"모델 번호","description":"제조사가 장치 식별을 위해 부여한 고유 번호입니다."},"mobile_card":{"name":"모바일 카드","description":"사용자 및 크리덴셜 데이터를 모바일 장치에 저장하여 NFC 또는 BLE 기술을 통해 인증을 수행하는 카드입니다. 모바일 카드는 플라스틱 카드에 비해 높은 보안성과 편의성을 함께 도모할 수 있으며, 거의 모든 사람들이 일상적으로 사용하는 모바일 기기를 이용함으로써 카드 발급 및 관리 비용을 절감할 수 있다는 장점이 있습니다."},"wlan":{"name":"무선 랜","description":"무선 주파수(RF) 기술을 이용한 근거리 네트워크입니다. 무선 접속 장치(AP)가 설치된 곳을 중심으로 일정 거리 내에서 WLAN 카드가 장착된 단말기를 이용해 통신망을 이용할 수 있습니다."},"access_point":{"name":"무선 접속 장치(Access Point, AP)","description":"무선 랜을 설치하기 위한 중계 장치입니다. 유선 랜을 통해 무선망에 연결하는 역할입니다."},"brute_attack":{"name":"무작위 대입법","description":"무차별 대입 공격(Brute-Force Attack)이라고도 하며, 암호를 풀기 위해 가능한 모든 값을 무작위로 대입하는 것을 의미합니다."},"ups":{"name":"무정전 전원 공급 장치(Uninterruptible Power Supply system, UPS)","description":"정전 등의 이유로 주 전원의 공급이 중단되었을 때, 일정 시간 동안 내장된 배터리를 이용해 장치에 비상 전원을 공급해 주는 장치입니다. 통신, 방송, 의료 시설, 데이터 센터, 기간 시설과 같이 전원의 안정적 공급이 필수적인 시설에서 주로 사용합니다."},"biometric_information":{"name":"바이오(인식) 정보","description":"개인의 신원을 식별할 수 있는 정보입니다. 개인이 가진 고유한 신체적, 행동적 특징을 갖는 정보로 지문, 서명, 정맥 패턴, 얼굴, 음성, 홍채, 유전자 등을 의미합니다."},"biometrics":{"name":"바이오 인식","description":"사람의 신체적, 행동적 특징을 자동화된 장치로 추출하고 분석하여 개인의 신원을 확인하는 기술입니다. 생체 인식이라고도 합니다."},"biometric_auth":{"name":"바이오 인증","description":"개인의 바이오 정보와 데이터베이스에 저장된 개인의 바이오 인식 특징을 비교하여 일치 여부를 판단하는 기술입니다."},"semiconductor_fp_sensor":{"name":"반도체식 지문 센서","description":"다수의 센서를 반도체 위에 배열하여 지문 정보를 전기적으로 검출하는 센서입니다."},"waterproof":{"name":"방수","description":"우천이나 침수 등으로 인해 장치에 액체가 스며들어 장치 기능에 영향을 주는 것을 방지하기 위한 처리 방식입니다."},"firewall":{"name":"방화벽","description":"개인 및 조직의 PC에서 사용하는 네트워크에 허가 받지 않은 외부인이 접근하여 정보를 유출하거나 시스템을 손상시키는 것을 방지하기 위한 보안 시스템입니다. 방화벽은 외부의 인터넷과 내부의 전용 네트워크의 경계에 위치하며, 외부로부터 들어오는 접근 시도를 정해진 접근 제어 목록에 따라 허용 또는 차단합니다."},"backlight":{"name":"백 라이트(Backlight)","description":"액정 표시 장치의 가시성을 위해 액정 뒤에서 비추는 조명입니다."},"backlight_timeout":{"name":"백 라이트 타임아웃(Backlight timeout)","description":"백 라이트가 켜진 뒤 유지되는 시간입니다."},"parallel_port":{"name":"병렬 포트","description":"병렬 인터페이스를 통해 데이터를 동시에 전송하는 방식의 입출력 접속구입니다."},"security_level":{"name":"보안 등급","description":"사용자의 신원을 확인하는 데 필요한 지문의 일치 정도입니다. 보안 수준이 높을수록 본인 거부율이 높아질 수 있습니다."},"secure_tamper":{"name":"보안 탬퍼","description":"장치가 브래킷과 분리되어 탬퍼가 발생할 경우 장치에 저장되어 있는 사용자, 로그, 암호화 키, SSL 인증서에 대한 모든 정보를 즉시 삭제하는 기능입니다."},"decryption":{"name":"복호화","description":"암호화된 데이터를 복호화 키를 이용해 원래대로 복원하는 처리 방식입니다. 암호화된 데이터는 암호화에 사용된 키와 쌍을 이루는 대칭 키로만 복호화가 가능합니다."},"frr":{"name":"본인 거부율(오거부율, False Rejection Rate, FRR)","description":"바이오 인식 시스템의 정확성을 비교하는 데 사용하는 기준으로 등록자를 비등록자로 인식할 확률입니다."},"leave_manage":{"name":"부재 관리","description":"휴가, 출장, 외출, 외근 등으로 인한 근로자의 부재를 관리하는 프로세스입니다."},"bifurcation":{"name":"분기점","description":"두 개의 지문 융선이 만나거나 나누어지는 지점입니다."},"blacklist":{"name":"블랙 리스트(Black list)","description":"BioStar 장치에서 인증이 거부되는 카드 목록입니다. 카드를 분실하거나 도난당한 경우 블랙리스트에 카드 ID를 등록하여 오용을 방지할 수 있습니다."},"bluetooth":{"name":"블루투스(Bluetooth)","description":"근거리에서 양방향 데이터 송수신을 지원하는 통신 기술입니다. 전송 거리, 전송 방식, 전원 소모량 등에 따라 각각 다른 특징이 있습니다."},"contactless_card":{"name":"비접촉식 카드","description":"카드에 내장된 코일 안테나를 이용해 카드 단말기와 통신하는 카드입니다. 카드 단말기와 접촉 없이 자기장을 이용해 데이터를 전송할 수 있습니다."},"user":{"name":"사용자","description":"슈프리마 장치를 사용하는 개인을 지칭합니다."},"user_id":{"name":"사용자 ID","description":"특정 사용자를 식별하기 위해 사용되는 영어 또는 숫자로 이루어진 고유 식별 부호입니다."},"user_group":{"name":"사용자 그룹","description":"출입 그룹의 구성 요소로, 관리의 용이성을 위한 사용자 집합입니다."},"user_sync":{"name":"사용자 동기화","description":"BioStar 서버에서 변경된 사용자 정보를 자동으로 장치에 보내는 것."},"weatherproof":{"name":"생활 방수","description":"방수보다는 다소 낮은 수준의 방수 성능을 의미합니다."},"server":{"name":"서버(Server)","description":"네트워크 환경에서 클라이언트의 요청에 따라 서비스를 제공하는 컴퓨터 또는 시스템입니다. 컴퓨터 프로그램 또는 장치를 의미하기도 합니다."},"server_matching":{"name":"서버 매칭(Server matching)","description":"서버에 저장된 크리덴셜 정보와 사용자가 입력한 크리덴셜 정보를 비교하는 기능입니다."},"server_mode":{"name":"서버 모드(Server mode)","description":"서버와 장치를 연결할 때 장치에서 서버 IP 주소를 직접 입력하는 방식입니다. 직접 입력 방식이기 때문에 장치가 다른 서버나 클라이언트에 잘못 연결될 위험이 없고, 연결이 끊기는 경우에도 자동으로 재연결되므로 안정적인 네트워크 환경을 구성할 수 있습니다."},"sensor_sensitivity":{"name":"센서 감도","description":"지문 이미지를 정확하게 검출할 수 있는 정도입니다. 감도가 높을수록 지문 이미지를 쉽게 얻을 수 있지만 잡음에 대한 민감도도 함께 높아지게 되어 정확한 이미지 검출이 어려울 수 있습니다."},"muster_zone":{"name":"소집 구역","description":"화재 등 긴급 상황 발생 시 구성원이 모이도록 지정된 구역입니다. 특정 구역에 있는 인원의 수와 명단을 모니터링하거나, 특정 구역에 사용자가 일정 시간 이상 체류하는 경우 알람 및 경보로 관리자에게 알려줄 목적으로 사용합니다."},"sdk":{"name":"소프트웨어 개발 키트(Software Development Kit, SDK)","description":"소프트웨어 개발자가 특정한 소프트웨어 프레임워크, 하드웨어 플랫폼, 컴퓨터 등을 위한 응용 프로그램을 만들 수 있게 하는 개발 도구의 집합입니다."},"shrink_tube":{"name":"수축 튜브","description":"열을 가하면 수축하는 튜브 형태의 고무 탄성체입니다. 주로 전자 제품의 케이블을 단선, 부식, 침수 등으로부터 보호하기 위해 사용합니다."},"suprema_template":{"name":"슈프리마 템플릿","description":"슈프리마에서 정의한 지문 템플릿입니다."},"smart_card":{"name":"스마트 카드(Smart Card)","description":"데이터 읽기와 쓰기가 모두 가능한 13.56MHz 대역의 전자식 카드로, 특정 리더만 읽기가 가능하도록 설정하거나 데이터를 암호화하는 등 다양한 보안 기능을 적용할 수 있습니다."},"scan":{"name":"스캔(Scan)","description":"지문 정보를 디지털 데이터로 전환하기 위해 센서 표면에 손가락을 대거나 일정한 속도로 움직이는 동작을 의미합니다."},"schedule_unlock":{"name":"스케줄 개방","description":"특정 구역의 출입문이 미리 정해진 스케줄에 따라 개방되는 기능입니다."},"schedule_lock":{"name":"스케줄 잠금","description":"특정 구역의 출입문이 미리 정해진 스케줄에 따라 잠기는 기능입니다."},"slave_device":{"name":"슬레이브(Slave) 장치","description":"RS-485로 연결한 장치 중 리더 또는 입출력 기능만 수행하는 장치입니다. 사용자 정보를 갖고 있지 않으며 마스터 장치에 의해 제어됩니다."},"puch":{"name":"시간 기록","description":"근무 시작 또는 마감 시간을 나타내는 이벤트입니다."},"time_sync":{"name":"시간 동기화","description":"네트워크에서 서로 다른 장치 또는 시스템 간에 시간을 동일하게 맞추는 기능입니다."},"overtime":{"name":"시간외 근무","description":"근로기준법 또는 사규에서 정한 1일 근무 시간을 넘어서 근무하는 것으로 조기 출근, 잔업, 휴일 근무 등이 포함될 수 있습니다."},"serial_comm":{"name":"시리얼(Serial) 통신","description":"여러 개의 비트(Bit)를 순차적으로 전송하는 통신 방법입니다. 대표적으로 RS-232와 RS-485가 있습니다."},"meal_deduct":{"name":"식사 공제","description":"일일 총 근무 시간을 계산할 때 식사 시간을 제외한다는 의미입니다."},"real_time_log":{"name":"실시간 로그","description":"각각의 액세스 포인트(Access Point, AP)에서 실시간 발생한 이벤트에 대한 기록입니다."},"lvv":{"name":"실시간 비디오 보기","description":"비디오를 이용한 모니터링 방식의 하나입니다. BioStar에서는 IP 카메라의 화면과 이벤트 로그를 실시간으로 제공하며, 해당 출입문을 수동으로 열거나 잠글 수 있는 기능을 지원합니다."},"analog_intercom":{"name":"아날로그 인터폰","description":"아날로그 교환기와 회선망으로 구성된 인터폰입니다."},"apb":{"name":"안티패스백(Anti-Passback)","description":"출입 통제를 위해 구조적인 방법으로서, 출입문 안쪽/바깥쪽에 출입 통제 장치를 설치하여 구역에 출입할 때 반드시 인증을 통해 출입해야 하는 기능입니다. 카드를 사용해 출입할 때 리더기에 카드를 인식하지 않고 앞 사람을 따라 입실했다면, 퇴실할 때 출입문이 열리지 않으며 <b>안티패스백</b> 이벤트가 발생합니다.<br/><b>안티패스백</b>은 Hard APB와 Soft APB로 구분합니다. <b>안티패스백</b> 위반 시 Hard APB는 <b>안티패스백</b> 이벤트를 생성하고 출입할 수 없으며, Soft APB는 <b>안티패스백</b> 이벤트를 생성하고 출입은 가능합니다."},"alarm":{"name":"알람(Alarm)","description":"시스템에서 발생한 이벤트 중 실시간으로 조치가 필요한 이벤트 종류입니다."},"alarm_action":{"name":"알람 액션(Alarm action)","description":"알람이나 특정 이벤트가 발생하면 자동으로 장치를 제어하거나 이메일 전송 등을 수행합니다."},"password":{"name":"암호","description":"개인이 사용자 ID와 함께 인증을 위해 사용하는 문자열입니다."},"encryption":{"name":"암호화","description":"원래 의미를 알 수 없도록 정보를 변환 처리 기능입니다. 암호화된 형태로 정보를 저장하거나 전송함으로써 정보를 보호할 수 있습니다."},"encryption_key":{"name":"암호화 키","description":"암호화를 위해 생성된 임의의 비트 문자열입니다. 암호화 키는 모든 키를 예측할 수 없도록 고안된 알고리즘으로 설계되며, 일반적으로 암호화 키가 길수록 해독이 어려워집니다."},"access_on_card":{"name":"액세스 온 카드(Access on Card)","description":"사용자의 ID와 크리덴셜, 출입 그룹 정보를 기록한 카드입니다."},"face_detection":{"name":"얼굴 검출","description":"장치에서 사용자의 크리덴셜을 검증한 뒤 출입을 허가하기 전에 사용자의 얼굴도 함께 촬영하여 해당 이벤트와 얼굴 이미지도 함께 저장하는 기능입니다. 얼굴이 검출되지 않으면 인증에 실패합니다. 얼굴 이미지가 저장되었을 때 필요에 따라 이벤트 발생 시 기록된 사용자 아이디와 얼굴 이미지를 비교하여 동일인임을 확인할 수 있습니다."},"face_recognition":{"name":"얼굴 인증","description":"사람의 얼굴 특징을 이용하여 신원을 확인하는 기술 또는 그러한 인증 체계입니다."},"upgrade":{"name":"업그레이드(Upgrade)","description":"하드웨어나 소프트웨어의 성능을 기존 제품보다 뛰어난 새것으로 바꾸는 작업입니다."},"epoxy_potted":{"name":"에폭시(Epoxy)","description":"장치를 옥외에 설치할 경우 빗물이 장치에 들어가는 것을 방지하여 회로를 보호하기 위해 사용하는 소재입니다."},"live_face_detection":{"name":"위조 얼굴 감지(Live Face Detection) 기술","description":"마스크나 사진 등의 위조 얼굴을 감지하는 기술입니다."},"fake_fp":{"name":"위조 지문","description":"타인의 지문을 본떠서 종이, 실리콘, 고무 등으로 만든 가짜 지문입니다."},"live_fp_detection":{"name":"위조 지문 감지(Live Finger Detection) 기술","description":"고무, 실리콘, 점토, 접착제, 필름 등으로 복제한 위조 지문을 감지하는 기술입니다."},"floating_shift":{"name":"유동 근무","description":"BioStar에서 제공하는 근무 규칙 중 하나로, 출근과 퇴근 시간이 정해져 있지 않으며 사용자가 출근하는 시간에 따라 해당 날짜의 근무 규칙이 적용되는 방식입니다."},"ridge":{"name":"융선","description":"지문을 나타내는 하나의 지문 곡선으로서 연속되는 융선과 중간에 끊어지는 끝점, 2개의 융선이 만나는 분기점으로 되어 있으며, 이들을 특징점(minutiae)이라 지칭합니다."},"voice_prompt":{"name":"음성 안내","description":"사용할 수 있는 옵션을 사용자에게 음성으로 안내하는 기능입니다."},"api":{"name":"응용 프로그램 프로그래밍 인터페이스(Application Programming Interface, API)","description":"웹 애플리케이션을 개발할 때 다른 서비스 플랫폼에 요청을 보내고 응답을 받기 위해 정의된 명세입니다. 응용 프로그램에서 사용할 수 있도록 운영 체제나 프로그래밍 언어가 제공하는 기능을 제어할 수 있게 만든 인터페이스입니다. 주로 파일 제어, 장치 제어, 화상 처리, 문자 제어 등을 위한 인터페이스를 제공합니다."},"event":{"name":"이벤트(Event)","description":"사용자, 장치, 출입문 간에 발생하는 상호 작용입니다. BioStar 서버에 로그로 기록되며 인증 성공 및 실패, 출입문 상태 변화, 경보, 알람 등이 있습니다."},"dual_auth":{"name":"이중 인증","description":"제한된 시간 안에 서로 다른 두 사람의 크리덴셜을 순차적으로 입력하는 인증 방식입니다."},"auth":{"name":"인증","description":"사용자가 입력한 크리덴셜을 검증하여 신원을 판별하는 동작입니다."},"auth_mode":{"name":"인증 모드","description":"인증을 위해 필요한 크리덴셜의 조합입니다."},"interlock_zone":{"name":"인터락(Interlock) 구역","description":"두 개 이상의 출입문 사이에 있는 공간으로, 하나의 출입문이 열려 있거나 잠금 해제되면 나머지 출입문은 잠기는 구역입니다."},"intercom":{"name":"인터폰","description":"한 건물이나 기관 안에 사설 구내 교환기(PBX)를 이용하여 구축한 통신 시스템입니다."},"batch_enrollment":{"name":"일괄 등록","description":"여러 장의 출입 카드를 BioStar 서버에 등록하는 것을 말하며, 등록된 카드는 개별 사용자에게 할당할 수 있습니다."},"dst":{"name":"일광 절약 시간(Daylight Saving Time, DST)","description":"하절기에 낮 시간을 효율적으로 활용하기 위해 표준 시간보다 시계를 일정 시간 앞당겨 설정하는 제도입니다. 주로 에너지 절약과 생산성 향상을 목적으로 시행합니다. 서머 타임(Summer Time)이라고도 하며, 주로 3월 마지막 일요일부터 10월 마지막 일요일까지 시행합니다."},"io_device":{"name":"입출력 장치","description":"정보 입출력 기능을 수행하는 장치입니다."},"lock":{"name":"잠금 장치","description":"출입 통제 시스템과 연결되어 출입문을 잠그는 데 사용되는 전자 장치입니다. 출입문에 내장되었거나 장착된 전자 장치를 통칭합니다."},"held_open":{"name":"장시간 문 열림","description":"출입문이 정해진 시간을 초과하여 열린 채 방치된 상태입니다. 알람(Alarm) 이벤트를 동작하는 트리거입니다."},"device":{"name":"장치","description":"BioStar에서 제어할 수 있는 출입 통제 장치입니다."},"device_id":{"name":"장치 ID","description":"BioStar에서 각 하드웨어 장치를 고유하게 식별하기 위해 부여된 숫자 기반의 식별자입니다."},"restart":{"name":"재시작","description":"장치 작동 중 프로그램 실행에 문제가 발생하여 강제로 전원을 완전히 끈 뒤 다시 켜는 행위입니다."},"ble":{"name":"저전력 블루투스(Blooth Low Energy, BLE)","description":"약 10m 내외의 거리에서 2.4GHz 주파수를 이용해 저전력 저용량 데이터를 송수신할 수 있는 블루투스 기술입니다. 저전력 블루투스 기술은 전력의 소모가 매우 적어 전력 공급이 제한되는 소형 장치에 주로 사용되며, 출입통제 분야에서도 모바일 ID 카드의 형태로 활용되고 있습니다."},"cde":{"name":"적합성 판단 엔진(Conformance Decision Engine, CDE)","description":"슈프리마의 지문 매칭 알고리즘의 절차 중 하나로, 지문 이미지를 처리하여 지문의 특징점을 추출하기 전에 먼저 올바른 지문 이미지를 획득하였는지를 판단하는 단계입니다."},"contact_card":{"name":"접촉식 카드","description":"표면에 금색 또는 은색의 칩이 부착된 카드입니다. 데이터 전송을 위해서 카드 단말기에 칩이 직접 접촉되도록 삽입해야 합니다."},"termination":{"name":"종단 저항","description":"RS-485 통신에서 신호 반사를 방지하고 신호 품질을 유지하기 위해 데이지 체인의 끝에 연결하는 저항입니다. 통신 오류를 줄이고 안정적인 데이터 전송을 보장합니다."},"intelligent_reader":{"name":"지능형 카드 리더","description":"사용자 정보, 출입 정보를 저장하고 입력된 크리덴셜을 인증하여 사용자 출입을 허가할 수 있는 장치입니다."},"fp":{"name":"지문","description":"손가락 끝 마디에 있는 곡선 모양의 무늬입니다."},"fp_sensor":{"name":"지문 센서","description":"지문 인식 기술에서 손가락 지문의 영상 정보를 획득하는 장치입니다. 사람마다 고유한 지문 특성을 읽어 디지털 데이터로 변환하며, 지문 스캐너에서 손가락을 올려놓는 부분을 포함합니다."},"fp_scanner":{"name":"지문 스캐너","description":"사용자의 지문을 데이터베이스에 등록하기 위해 지문을 스캔하는 장치입니다."},"fp_recognition":{"name":"지문 인식","description":"지문에 포함된 고유한 특징점을 분석하여 개인의 신원을 확인하는 기술입니다. 지문 인식은 손가락 끝의 융선과 분기점을 기반으로 데이터를 비교하여 인증하거나 식별하는 데 사용합니다."},"fp_scan_timeout":{"name":"지문 입력 타임아웃","description":"지문 정보 입력 제한 시간입니다."},"fp_template":{"name":"지문 템플릿","description":"지문 이미지에서 발견되는 융선의 끝점이나 분기점 등 일련의 세밀한 특징점을 모은 지문 정보입니다. 특징점의 위치와 개수를 비교하여 식별에 사용합니다."},"stp":{"name":"차폐 연선","description":"외부의 노이즈를 차단하거나 전기적 신호의 간섭을 줄이는 차폐막으로 감싼 케이블입니다. 신호 간섭이 많은 공장이나 야외, 또는 통신 시 빠른 속도가 필요한 곳에 주로 사용합니다."},"clean_room":{"name":"청정실","description":"먼지, 바이러스, 금속 가루, 세포 등 공기 중 부유 입자를 필요에 따라 제어할 수 있는 공간입니다."},"initialize_reset":{"name":"초기화","description":"하드웨어나 소프트웨어의 설정 등을 지정한 초기값으로 되돌리는 동작입니다."},"mtu":{"name":"최대 전송 단위(Maximum Transmission Unit, MTU)","description":"네트워크를 통해 전송할 수 있는 최대 패킷 크기입니다."},"msb":{"name":"최상위 비트(Most Significant Bit, MSB)","description":"2진수 데이터에서 가장 높은 자리(가장 왼쪽)의 비트나 그 내용입니다. 최하위 비트(Least Significant Bit, LSB)와 대비되는 용어입니다."},"lsb":{"name":"최하위 비트(Least Significant Bit, LSB)","description":"2진수 데이터에서 가장 낮은 자리(가장 오른쪽)의 비트나 그 내용입니다. 최상위 비트(Most Significant Bit, MSB)와 대비되는 용어입니다."},"punch_in":{"name":"출근 기록","description":"출근 시간을 기록하는 동작입니다."},"output_relay":{"name":"출력 릴레이","description":"다른 장치에 영향을 주기 위해 전기적 접촉을 통해서 열거나 닫는, 전자 제어 장치입니다."},"access":{"name":"출입","description":"특정 구역 또는 자산에 접근하는 행위입니다."},"access_rule":{"name":"출입 규칙","description":"특정 출입문/출입문 그룹에 정해진 스케줄 동안 출입할 수 있는 규칙입니다."},"access_group":{"name":"출입 그룹","description":"정해진 출입문/출입문 그룹에 정해진 스케줄에 출입할 수 있는 권한을 가진 사용자 그룹입니다."},"access_level":{"name":"출입 등급","description":"지정한 스케줄 동안 출입문에 출입할 수 있는 권리입니다."},"entrance_limit_zone":{"name":"출입 제한 구역","description":"특정한 시간대에 출입을 제한하는 구역입니다. 인증 또는 인증 횟수를 제한하는 방식으로 구성할 수 있습니다."},"access_control":{"name":"출입통제","description":"허가되지 않은 사람이 제반 시설이나 자산에 접근하는 것을 제한하는 정책입니다. 허가된 사람일 경우 로그를 통해 기록을 생성합니다."},"door":{"name":"출입문","description":"출입통제를 위해 물리적인 장치가 설치되는 곳으로 출입통제의 기본이 되는 공간적인 개념입니다."},"door_group":{"name":"출입문 그룹","description":"관리의 용이성을 위한 출입문 집합이며, 출입문 그룹 단위로 이벤트를 감시할 수 있습니다. 출입 그룹의 기본 구성 요소입니다."},"door_sensor":{"name":"출입문 센서","description":"출입문 상태를 탐지하는 센서입니다. 열림, 닫힘, 열려 있음, 강제 열림 등의 상태를 확인할 수 있습니다."},"card":{"name":"카드","description":"휴대 가능한 카드 모양의 정보 매체로서 신분 증명을 위한 정보가 저장되어 있습니다."},"card_id":{"name":"카드 ID","description":"회사와 조직, 부서에서 정의한 형식에 따라 부여한 카드의 고유 번호입니다. 카드 ID는 카드 제조사에서 부여한 카드의 고유 번호 또는 특정 회사나 조직에서 정의한 형식의 번호가 될 수 있습니다."},"card_layout":{"name":"카드 레이아웃","description":"카드 내 데이터의 배열 및 구조입니다."},"card_mode":{"name":"카드 모드","description":"카드 소지자를 인증하는 방식으로 <b>카드 ID 모드</b>와 <b>템플릿 온 카드 모드</b>, 2가지 방법이 있습니다. <b>카드 ID 모드</b>는 카드에 저장된 카드 ID를 기준으로 장치 내에 저장된 사용자 ID와 지문 정보를 비교하는 반면, <b>템플릿 온 카드 모드</b>는 사용자가 입력한 지문과 카드 내의 지문 정보가 일치하는지 검사하여 사용자의 신원을 파악합니다."},"csn":{"name":"카드 일련 번호(Card Serial Number, CSN)","description":"제조사가 부여한 카드의 고유 번호입니다."},"card_reader":{"name":"카드 판독기","description":"카드에 저장된 정보를 읽어 컨트롤러로 전송하는 장치입니다."},"kernel":{"name":"커널(Kernel)","description":"운영체제의 가장 핵심적인 부분으로 메모리, 프로세스 등의 중요 자원을 관리하며, 부팅 시 메모리에 로드되어 여러 가지 기본 서비스를 제공합니다."},"controller":{"name":"컨트롤러(Controller)","description":"리더(Reader)에서 획득한 크리덴셜 정보를 이용하여 출입 권한을 판별하고 리더(Reader)의 입출력을 제어하는 장치입니다."},"credential":{"name":"크리덴셜(Credential)","description":"사용자의 신원을 확인하기 위한 데이터입니다. 일반적으로 디지털 서명, 스마트카드, 바이오 정보, 사용자 이름과 비밀번호 등이 있습니다."},"client":{"name":"클라이언트(Client)","description":"네트워크를 이용해 서버에 서비스를 요청하는 주체입니다."},"far":{"name":"타인 수락률(오인식률, False Acceptance Rate, FAR)","description":"바이오 인식 시스템의 정확성을 비교할 때 사용되는 기준으로 비등록자를 등록자로 잘못 인식할 확률입니다."},"transaction":{"name":"트랜잭션(Transaction)","description":"데이터베이스에 대한 조회나 갱신 조작 등으로 구성되는 처리의 기본 단위입니다. 갱신에 의해 일시적으로 일치하지 않는 데이터가 사용되지 않도록 하기 위해 묶어서 처리합니다. 트랜잭션이 충족해야 하는 기술적 요건은 <a href=\'#acid\'>ACID 특성</a>이 있습니다."},"tamper":{"name":"탬퍼(Temper)","description":"장치 상태를 모니터링할 수 있는 방법의 하나로, 외부 요인에 의해 장치가 설치된 브래킷에서 분리되면 경보가 울리거나 서버에 이벤트가 기록되게 설정할 수 있습니다."},"tailgating":{"name":"테일게이팅(Tailgating)","description":"부정 인증을 이용한 출입 방법의 하나로, 제한된 구역에 대한 출입 권한이 없는 사람이 앞 사람을 따라 진입하는 행위입니다. \'2인 진입\'이라고도 하며, <b>피키배킹(Piggybacking)</b>과 함께 가장 대표적인 부정 출입 방법입니다. 일반적으로 <b>테일게이팅(Tailgating)</b>은 의도를 가지지 않은 부정 출입을, <b>피키배킹(Piggybacking)</b>은 의도를 가진 부정 출입을 의미합니다."},"template":{"name":"템플릿(Template)","description":"바이오 특징을 추출한 후 부호화하여 저장한 데이터로서, 바이오 인식 시스템 또는 장치에서 사용자가 입력한 바이오 샘플과 비교하여 신원을 파악하는 데 사용합니다."},"template_on_card":{"name":"템플릿 온 카드(Template on Card)","description":"사용자 정보 및 지문 템플릿을 저장할 수 있는 스마트 카드입니다."},"punch_out":{"name":"퇴근 기록","description":"퇴근 시간을 기록하는 행위 또는 동작입니다."},"exit_button":{"name":"퇴실 버튼","description":"출입문을 열기 위한 버튼입니다. 이 버튼을 누르면 출입문이 열리며, 별도의 인증이 필요하지 않은 출입문이나 구역에 사용할 수 있습니다."},"trigger_action":{"name":"트리거 액션(Trigger action)","description":"알람이나 특정 이벤트가 발생하면 자동으로 장치를 제어하거나 이메일 전송 등을 수행합니다."},"minutiae":{"name":"특징점","description":"지문을 인식하는 데 사용되는 융선의 세밀한 특징적 요소들입니다."},"tilting_bracket":{"name":"틸팅 브래킷(Tilting bracket)","description":"각도 조절이 가능한 브래킷입니다. 얼굴 인증 장치 또는 홍채 인식 장치에서 주로 사용합니다."},"firmware":{"name":"펌웨어(Firmware)","description":"제품의 하드웨어를 제어하기 위해 롬(ROM)에 저장한 마이크로 프로그램 및 파일입니다."},"port_number":{"name":"포트(Port) 번호","description":"TCP/UDP에서 상호 통신하기 위해 사용하는 포트 번호입니다. 범위는 0~65535입니다."},"timezone":{"name":"표준 시간대","description":"동일한 시간을 사용하는 지리적 구역입니다. 출입 통제를 위해 장치나 BioStar의 시간을 설정할 때 사용합니다."},"protocol":{"name":"프로토콜(Protocol)","description":"시스템 또는 단말기 사이에 데이터를 교환하기 위해 사용하는 통신 규칙입니다."},"piggybacking":{"name":"피키배킹(Piggybacking)","description":"부정 인증을 이용한 출입 방법의 하나로, 제한된 구역에 대한 출입 권한이 없는 사람이 의도적으로 출입 권한을 가진 사람과 함께 진입하는 행위입니다. \'Piggybacking\' 또는 \'Piggyback\'이라고도 하며, <b>테일게이팅(Tailgating)</b>과 함께 가장 대표적인 부정 출입 방법입니다. 일반적으로 <b>피키배킹(Piggybacking)</b>은 의도를 가진 부정 출입을, <b>테일게이팅(Tailgating)</b>은 의도를 가지지 않은 부정 출입을 의미합니다."},"bypass_card":{"name":"항시 통과 카드","description":"인증 절차를 우회하여 특정 지역에 접근할 수 있는 카드입니다. 예를 들어, 해당 카드를 소지한 사람은 일련의 보안(인증) 절차를 거치지 않고 출입문을 통과할 수 있습니다."},"grace":{"name":"허용 시간","description":"근태 규칙에 대한 허용 시간입니다. 예를 들어, 출근 시간을 9시로 설정하고 허용 시간을 10분으로 설정했을 때, 9시부터 9시 10분 사이에 출근하면 지각으로 처리하지 않습니다."},"duress":{"name":"협박 지문","description":"지문 등록 시 특정 이벤트를 발생시키기 위해 지정한 지문입니다. 해당 지문으로 인증하면 로그에 협박 지문 인증으로 로그가 남고 관리자는 이 로그를 이용하여 별도의 알람을 설정할 수 있습니다."},"fire_alarm_zone":{"name":"화재 경보 구역","description":"화재가 발생할 경우 모든 출입문 또는 엘리베이터가 개방되거나 잠기도록 설정한 구역입니다."},"vacation":{"name":"휴가","description":"미리 정해진 사유 또는 허가를 받고 근무를 쉬는 것 또는 쉬는 기간입니다."},"break":{"name":"휴식","description":"근무 시간 중 업무를 잠시 중단하고 쉬는 행위입니다. 휴식 시작과 종료 시간 사이의 시간으로 계산합니다."}}')
;// CONCATENATED MODULE: ./i18n/en/glossary.json
var en_glossary_namespaceObject = JSON.parse('{"onetoone_auth":{"name":"1:1 Authentication","description":"Authentication method that verifies the user by comparing the individual\'s biometric data one-to-one with the biometric data stored in the database."},"onetomany_auth":{"name":"1:N Authentication","description":"Authentication method that retrieves user information from a database. It identifies an individual by comparing their biometric information with information in all registered databases."},"acid":{"name":"ACID","description":"The ACID represents four main properties that a transaction should have, the terminology stands for Atomicity, Consistency, Isolation and Durability. Atomicity, as the very basic operation unit, requires each transaction to be ‘all or nothing’, or simply all-success or all-fail. Consistency ensures any transaction to bring the database from one valid state to another. Isolation ensures the transaction in process must remain isolated from any other transactions. Durability ensures integrity that committed data is kept in the drive even in the event of failure for restructure."},"ad_hoc":{"name":"Ad Hoc Network","description":"A network that is autonomously configured by each device without reliance on network infrastructure such as a base station and an access point. In this network, a dynamic and autonomous network topology is formed despite each device communicating through a wireless interface, as each device can be moved freely thanks to a routing function that enables the distance limitations of wireless communication to be overcome."},"ansi378":{"name":"ANSI 378","description":"The fingerprint template standards defined by the American National Standards Institute (ANSI)."},"dhcp":{"name":"DHCP","description":"A communication protocol used for the automatic allocation and management of settings required for TCP/IP communication."},"dip_switch":{"name":"DIP switch","description":"A DIP switch is an On/Off switch that is used to control the behavior of a device circuit board without hardware alteration."},"fail_safe_lock":{"name":"Fail Safe Lock","description":"This means that the system enters safe mode in the event of a power outage. In the event that the power supplied to the doors is cut off due to a fire, etc., the lock will be released, thereby opening the doors."},"fail_secure_lock":{"name":"Fail Secure Lock","description":"This means that the system enters security mode in the event of a power outage. In the event that the power supplied to the doors of a critical site such as a bank is cut off, the doors will be locked."},"fastcgi":{"name":"FastCGI","description":"FastCGI is a web-server plugin program which allows one process to handle multiple CGI(Common gateway interface) requests at once with faster speed."},"hf_card":{"name":"HF(High Frequency) Card","description":"An electronic card that operates in the 13.56 MHz band and is capable of both reading and writing data. An HF card can be fitted with various security functions, such as data encryption and allowing it to be read by a specific reader only."},"http":{"name":"HTTP","description":"Short for Hypertext Transfer Protocol, this term refers to the protocol whereby a web client and a web server exchange data via a web browser."},"https":{"name":"HTTPS","description":"Short for Hypertext Transfer Protocol over Secure Sockets Layer. This term refers to a protocol that provides enhanced security compared to HTTP. All data transmitted and received through HTTPS is encrypted, so HTTPS provides better security than HTTP."},"ic_card":{"name":"IC card(integrated circuit card)","description":"A card with a built-in semiconductor-based integrated circuit. Also called a smart card. IC cards are capable of both reading and writing data, and have a larger storage capacity and greater durability than magnetic cards, so the data stored on them is not damaged by contact with magnets. In addition, because IC cards can be fitted with various security functions such as data encryption and configured to be compatible only with readers that have particular specifications, they are also excellent in terms of security and functionality."},"ik_rating":{"name":"IK rating","description":"An international rating system that defines the degree of product protection against physical impacts."},"io":{"name":"I/O","description":"Short for input/output."},"ip_rating":{"name":"IP rating","description":"An international rating system that defines the degree of product protection against solids and liquids."},"iso19749-2":{"name":"ISO 19749-2","description":"An international standard published by ISO that defines the fingerprint format information using the minutiae of fingerprints."},"json":{"name":"JSON","description":"JSON is a form of data representation that uses characters, parentheses, and symbols to transmit data objects. It can be used in various programming languages such as PHP, C#, Python, etc."},"lan":{"name":"LAN (Local Area Network)","description":"A network system with communication lines that connects computers, printers, and other devices in a limited area such as in a building, so they can interact with each other."},"lf_card":{"name":"LF(Low Frequency) Card","description":"An electronic card operating in a low-frequency band of 120-140 kHz."},"nc":{"name":"NC (Normally Closed)","description":"An action where the relay remains closed in normal status but opens when the device operates. The current flows through the connected circuit because the relay remained closed earlier."},"no":{"name":"NO (Normally Open)","description":"An action where the relay remains open in normal status but closes when the device operates. The current does not flow through the circuit because the relay remained open earlier."},"nvr":{"name":"NVR(Network Video Record)","description":"A function that records and monitors videos of access points using cameras or video devices installed on the network, and manages events that occur."},"osdp":{"name":"OSDP(Open Supervised Device Protocol)","description":"The standard RS-485 protocol developed by enhancing the Wiegand interface, through which only unidirectional communication from a reader to a controller was possible. This protocol enables processing of large amounts of data in a bidirectional reader-controller communication environment, as well as transmitting biometric data. Supporting this protocol also enables connectivity between third-party devices, so you can simply replace an existing system\'s items as necessary."},"poe":{"name":"PoE (Power over Ethernet)","description":"The system supplies power to the device through an Ethernet cable. Using a single cable to transmit data and supply power simplifies installation and expansion and reduces wiring costs."},"rest":{"name":"REST (Representational State Transfer)","description":"REST is an architectural style for distributed systems such as Web. REST interfaces with external systems using HTTP URI, and communicate with HTTP verbs (GET, POST, PUT, DELETE and etc)."},"rf":{"name":"RF (Radio Frequency)","description":"Radio frequency is an electromagnetic wave used to detect or transmit information over short or long distances. It is mainly used in communications, RFID technology, wireless networks, and other fields."},"rfid":{"name":"RFID (Radio-Frequency Identification)","description":"Technology that authenticates and identifies IDs using RF (Radio Frequency). Information is stored on an RFID tag composed of an antenna and a chip, and an RFID reader reads the tag to identify the information."},"rfid_tag":{"name":"RFID (Radio-Frequency Identification) tag","description":"It is an electronic tag attached to a card or other object that stores unique identification information for the person or object. An RFID reader wirelessly reads the information stored on the tag using radio waves. An RFID tag typically consists of a small processor, memory, a small antenna, and a battery, and can be classified into multiple types based on whether it supports reading and writing, whether it includes an internal power source, and its RF (radio frequency) band."},"rte":{"name":"RTE (request to exit) button","description":"A button to open the door from inside. Pressing this button opens the door. The button can be used for doors and zones that do not require separate authentication when exiting."},"rs485":{"name":"RS-485","description":"A standard protocol for serial communication that supports home networking. RS-232 has a low transfer rate and a short transmission range while RS485 enables all devices to transmit/receive data on the same line."},"ssl":{"name":"SSL (Secure Sockets Layer)","description":"It refers to an encryption protocol used by web clients and web servers to ensure security and data integrity when communicating over a network."},"tcpip":{"name":"TCP/IP","description":"Abbreviation of Transmission Control Protocol/Internet Protocol. It is a protocol for communication between computers and a combination of TCP and IP."},"tls":{"name":"TLS (Transport Layer Security)","description":"It refers to an encryption protocol used by web clients and web servers to ensure security and data integrity when communicating over a network."},"uhf":{"name":"UHF (Ultra High Frequency)","description":"Ultra high frequency (UHF) is an electromagnetic wave with frequencies between 300 and 3,000 MHz. It is used in various communication fields, including satellite broadcasting, mobile communications such as cellular phones, terrestrial digital TV, aviation radio, and RFID technology. Because of its high frequency, it has a short wavelength of 1–10 cm and is highly directional."},"voip":{"name":"VoIP","description":"A communication technology that provides a voice call service based on an Internet Protocol (IP) network."},"wiegand":{"name":"Wiegand","description":"A method that transfers a small amount of data using D0 and D1. Generally it is used as a method of communication between the reader and controller of an access control device."},"import":{"name":"Import","description":"The act of transferring data from one computer into its own system."},"audit_trail":{"name":"Audit trail","description":"The data recorded on system changes. The audit trail makes it possible to search for information about unauthorized user activity, the processing of user activity, etc."},"forced_open":{"name":"Forced open","description":"A status in which the opening of the door has been detected by the door sensor without the occurrence of a normal door open event, such as user authentication or use of the exit button."},"private_auth":{"name":"Private authentication","description":"An authentication method where user authentication is performed according to the combination of credentials specified by the administrator. This method takes precedence over other authentication methods."},"pin":{"name":"PIN (Personal Identification Number)","description":"A serial number given to an individual for their identification."},"alert":{"name":"Alert","description":"The act of displaying or forwarding in real time an alarm event occurred in the system."},"arm":{"name":"Arm","description":"The act of monitoring a specific zone for the prevention of crime and accidents. 24-hour monitoring, alarm notifications, recordings, etc. are available through a security system."},"intrusion_alarm_zone":{"name":"Intrusion Alarm Zone","description":"A zone set to emit a warning sound or relay signal if an unauthorized person attempts an intrusion after Arm. This zone normally begins monitoring after the day\'s work, and emits a preset alarm or signal when an intrusion attempt is detected."},"disarm":{"name":"Disarm","description":"The act of suspending the operation of an alarm system activated for a specific zone."},"zone":{"name":"Zone","description":"A device group that is subject to access rules. It is used to monitor events."},"aes":{"name":"AES (Advanced Encryption Standard)","description":"The Advanced Encryption Standard (AES) is a specification for the encryption of electronic data established by the U.S. National Institute of Standards and Technology (NIST)."},"administrator":{"name":"Administrator","description":"The user who has full access to the configuration software."},"optical_fp_sensor":{"name":"Optical fingerprint sensor","description":"A sensor that extract fingerprint information using light."},"graphic_map":{"name":"Graphic map","description":"One of the monitoring methods provided by BioStar. This function enables you to check and control the status of doors in real time from the map."},"nfc":{"name":"NFC(Near Field Communication)","description":"An RFID technology applied to mobile terminals to enable bidirectional transmission/reception of data at close range. With the rise in the smartphone penetration rate, this technology is increasingly used in various fields such as finance and communications, and it is also applied in access control in the form of mobile ID cards."},"tna":{"name":"T&A (Time and Attendance)","description":"A control function that collects and traces information about employees and their working hours, such as attendance and absences."},"tna_rule":{"name":"T&A rule","description":"The rule defined by the administrator in order to assess and manage the hours worked by employees."},"tna_event":{"name":"T&A event","description":"An event that indicates the T&A (Time and Attendance) status of employees. It records the entry and exit times of employees and calculates how many hours they worked in a certain period of time."},"global_zone":{"name":"Global Zone","description":"A zone where a server and a master device are connected via TCP/IP, and the master device and a slave device are connected via RS-485. The server performs the master role for the zone."},"payroll_sys":{"name":"Payroll system","description":"Calculates total wages based on employees\' working hours, attendance, and other tax factors to pay accurate salaries."},"export":{"name":"Export","description":"An operation performed by a program that uses a particular data format. It is the act of storing data in a format that is compatible with other programs."},"noise":{"name":"Noise","description":"The electrical signals that obscure or make it difficult to identify signals."},"direct_mode":{"name":"Direct mode","description":"A mode whereby the BioStar 2 client directly searches for connectable devices and connecting to them. In this mode, the client is responsible for communicating with devices and servers. In this mode, a list of connectable devices is shown when a device search is performed on the server, and the administrator can select a device to connect from the list."},"diode":{"name":"Diode","description":"A component that controls the current to flow in a single direction only. This component is used to prevent reverse current flow that momentarily occurs when the door lock operates."},"short":{"name":"Short circuit","description":"The wires are shorted. It typically occurs due to damaged wires or overcurrent."},"open":{"name":"Open","description":"A state in which no current flows because a wire has been broken, causing the circuit to open."},"bandwidth":{"name":"Bandwidth","description":"A range of frequencies where certain functions can be performed; measured in hertz (Hz). The amount of information that can be transmitted over a wire or another medium over a period of time. The greater the frequency bandwidth, the more information can be sent over a certain period of time."},"dummy_reader":{"name":"Dummy Reader","description":"A device that does not store or assess user data, but performs the role of reading credential data such as faces, fingerprints and cards, and transmits this data to the control device."},"daisy_chain":{"name":"Daisy Chain","description":"A daisy chain is a wiring scheme in which hardware devices are connected together in sequence."},"dbms":{"name":"DBMS (Database Management System)","description":"A DBMS is a software that controls and manages database, and interacts with a user or an application to access data in the database."},"door_contact":{"name":"Door Contact","description":"Another term for a door sensor. Magnetic sensor used to check the current state (closed/open) of a door."},"synchronization":{"name":"Synchronization","description":"The act of precisely matching time, information, etc. between different systems or networks."},"eer":{"name":"EER (Equal Error Rate)","description":"As an indicator of Biometric Performance, an ERR(Equal Error Rate) is a point where FAR (False Acceptance Rate) and FRR (False Rejection Rate) intersects. A device with lower EER is regarded to be more accurate."},"enrollment":{"name":"Enrollment","description":"A series of steps used to record the biometric information of users in a biometrics system. It involves sampling, template creation, storing, etc."},"log":{"name":"Log","description":"The records of all events occurred in the system, network, device, door, etc."},"local_zone":{"name":"Local Zone","description":"A zone set via an inter-device RS-485 connection. The master role for the zone is not performed by the server but by the master device."},"relay":{"name":"Relay","description":"A control device that auto-executes the opening and closing of the electric circuit according to changes in the current, voltage, frequency, etc. of another electric circuit."},"mag_card":{"name":"Magnetic stripe card","description":"A card that stores data by altering the magnetism of its magnetic tape. For data transmission, the magnetic tape attached on one side of a magnetic stripe card must be read by a card terminal. Only limited types and small amounts of data can be stored on this type of card, and the data recorded on magnetic stripe cards can be altered or damaged upon contact with a magnet. In addition, because magnetic stripe cards do not provide sufficient security due to the fact that they do not use data encryption, they are increasingly being replaced by IC cards in various fields, including access control."},"master_device":{"name":"Master device","description":"Among the devices that are connected through RS-485, the device that plays the role of a controller. It processes data by periodically monitoring the slave device. It is also called a host device."},"matching_timeout":{"name":"Matching timeout","description":"The time limit given to device matching or server matching. Matching fails if the matching does not get completed within the time limit."},"man_trap":{"name":"Man-trap","description":"A physical access control system for preventing unauthorized access and separating security zones from non-security zones."},"multi_rfid":{"name":"Multi-RFID technology","description":"A technology that allows cards operating in different frequency bands, such as 125 kHz and 13.56 MHz, to be read from a single device."},"message_timeout":{"name":"Message timeout","description":"The duration of time a message is displayed when there is no user interaction."},"monitoring":{"name":"Monitoring","description":"A surveillance activity for specific purposes. Monitoring access control and time and attendance management refers to checking access control events and user time and attendance events, as well as checking and controlling the status of devices, doors and zones in real time."},"model_number":{"name":"Model number","description":"A generic number given to a device by the manufacturer in order to identify its type."},"mobile_card":{"name":"Mobile card","description":"A card that stores user data and credential data on a mobile device and performs authentications through NFC or BLE technology. Mobile cards provide higher levels of security and convenience than plastic cards, and have the advantage of reducing card issuance and management expenses because they use mobile devices used by most people daily."},"wlan":{"name":"Wireless LAN","description":"A local area network that uses Radio Frequency (RF) technology. With a terminal fitted with a WLAN card, people can use a communication network within a certain distance from the place where an access point (AP)is installed."},"access_point":{"name":"AP (Access Point)","description":"A device for implementing a Wireless LAN. An access point creates a connection to a wireless network through a wired LAN."},"brute_attack":{"name":"Brutal attack","description":"Also called Brute Force Attack, this term refers to the act of entering all possible values to unlock passwords."},"ups":{"name":"UPS (Uninterruptible Power Supply system)","description":"Provides emergency power for a certain period using a built-in battery when the main power supply is interrupted due to a power outage or other reasons. Mainly used in facilities where a stable power supply is essential, such as communication, broadcasting, medical facilities, data centers, and infrastructure facilities."},"biometric_information":{"name":"Biometric information","description":"Information used to identify each individual. Information concerning the unique physical and behavioral characteristics of an individual, including the individual\'s fingerprint, signature, vein pattern, face, voice, iris, genes, etc."},"biometrics":{"name":"Biometric","description":"A technology that extracts and analyzes the physical and behavioral characteristics of individuals using an automated device for the identification of each individual."},"biometric_auth":{"name":"Biometric authentication","description":"The act of determining whether the provided biometric information of an individual matches the information on the individual’s Biometric characteristics previously enrolled."},"semiconductor_fp_sensor":{"name":"Semiconductor fingerprint sensor","description":"A multiple number of sensors arranged on a semiconductor that electrically detect fingerprint information."},"waterproof":{"name":"Waterproof","description":"Treatment that blocks liquids from seeping into the device due to rain or flooding and affecting its operation."},"firewall":{"name":"Firewall","description":"This security system prevents unauthorized external parties from accessing the network used by individuals and organizations’ PCs to leak information or damage the system. A firewall sits at the boundary between the external internet and the internal private network, allowing or blocking incoming access attempts according to a predefined access control list."},"backlight":{"name":"Backlight","description":"A light that emits from the back of the LCD of a device for readability."},"backlight_timeout":{"name":"Backlight timeout","description":"The duration of time the backlight remains on."},"parallel_port":{"name":"Parallel port","description":"Input and output port that transmits data simultaneously via a parallel interface."},"security_level":{"name":"Security level","description":"The accuracy of fingerprint matching level required to identify users. At a higher security level, the False Rejection Rate (FRR) can also be higher."},"secure_tamper":{"name":"Secure Tamper","description":"This feature deletes all information about users, logs, encryption keys, and SSL certificates stored on the device immediately when the device is separated from the bracket and a tamper occurs."},"decryption":{"name":"Decryption","description":"The act of recovering encrypted data using decryption keys. Encrypted data can only be decrypted with a symmetric key that pairs with the key used for the encryption of the encrypted data."},"frr":{"name":"FRR (False Rejection Rate)","description":"A criterion used when comparing the accuracy of different biometrics systems. It represents the probability of mistakenly recognizing a registered person as a non-registered person."},"leave_manage":{"name":"Leave Management","description":"The act of managing personnel absence due to vacations, business trips, external duties, etc."},"bifurcation":{"name":"Bifurcation","description":"A point where two fingerprint ridges meet or are separated."},"blacklist":{"name":"Blacklist","description":"A list of cards that are denied for authentication on the BioStar device. When a card is lost or stolen, misuse can be prevented by registering the ID of the card in the blacklist."},"bluetooth":{"name":"Bluetooth","description":"A communication technology that supports bidirectional transmission and reception of data at close range. Each type of Bluetooth has different characteristics depending on the transmission distance, transmission method, power consumption, etc."},"contactless_card":{"name":"Contactless card","description":"A card that communicates with a card terminal using its built-in coil antenna. This type of card enables transmission of data using a magnetic field without contacting a card terminal."},"user":{"name":"User","description":"An individual that uses the Suprema device."},"user_id":{"name":"User ID","description":"An identification code comprised of the alphabet, numbers, or a combination of both used to identify a certain user."},"user_group":{"name":"User group","description":"A group of users that is created for ease of management. A component of the access group."},"user_sync":{"name":"User synchronization","description":"The act of automatically sending to the device the user information that has been modified on the BioStar server."},"weatherproof":{"name":"Water Resistant","description":"This refers to a slightly lower level of waterproof performance than waterproof."},"server":{"name":"Server","description":"A computer program that provides services to other programs, or a computer on which a server program runs."},"server_matching":{"name":"Server matching","description":"A function that compares the credential information stored on the server and the credential information entered by a user."},"server_mode":{"name":"Server mode","description":"Enter the server IP address directly on the device to connect the server and the device. Because the address is entered directly, the device is not at risk of connecting to another server or client, and if the connection is lost, it reconnects automatically to achieve a stable network environment."},"sensor_sensitivity":{"name":"Sensor sensitivity","description":"The level of accuracy in detecting fingerprint images. With higher sensitivity, it is easier to get fingerprint images, but, because noise sensitivity increases also, it may be more difficult to perform accurate image detection."},"muster_zone":{"name":"Muster Zone","description":"A zone designated for the gathering of members in case of an emergency such as a fire. This is used to monitor the number and roster of personnel in a certain zone, and to notify administrators via an alarm or alert if a user has remained in a particular zone for a certain period of time."},"sdk":{"name":"SDK (Software Development Kit)","description":"A SDK is a set of software development tools that allows software developers to create applications for a certain software package, software framework, hardware platform, computer system, or similar development environment platform."},"shrink_tube":{"name":"Shrink tube","description":"Tube-shaped rubber elastomer that shrinks when heat is applied, mainly used to protect electronic device cables from breakage, corrosion, and water ingress."},"suprema_template":{"name":"Suprema template","description":"A fingerprint template type defined by Suprema."},"smart_card":{"name":"Smart Card","description":"An electronic card that operates in the 13.56 MHz band and is capable of both reading and writing data. An HF card can be fitted with various security functions, such as data encryption and allowing it to be read by a specific reader only."},"scan":{"name":"Scan","description":"The act of putting a finger on the surface of the sensor or moving a finger at regular speed for the conversion of fingerprint information into digital data."},"schedule_unlock":{"name":"Scheduled Unlock","description":"Opens doors in certain areas according to a predefined schedule."},"schedule_lock":{"name":"Scheduled Lock","description":"Locks doors in certain areas according to a predefined schedule."},"slave_device":{"name":"Slave device","description":"Among devices connected through RS-485, the device that only performs the input and output functions. It does not contain user information and is controlled by the master device."},"puch":{"name":"Punch","description":"An event that indicates the start time or the end time of work."},"time_sync":{"name":"Time sync","description":"A function that synchronizes the time between different devices or different systems on a network."},"overtime":{"name":"Overtime","description":"The time worked that is more than the daily working hours set by the Labor Standards Act or the company regulations. Overtime may include early work, extra work, holiday work, etc."},"serial_comm":{"name":"Serial communication","description":"A communication method that transmits multiple bits in sequence. RS-232 and RS-485 are popular examples."},"meal_deduct":{"name":"Meal deduction","description":"The act of excluding meal times when calculating the total number of daily working hours."},"real_time_log":{"name":"Real-time log","description":"Records of real-time events at each access point (AP)."},"lvv":{"name":"Live Video View","description":"A video-based monitoring method. BioStar provides IP camera screens and event logs in real time, and supports the ability to manually open/lock doors."},"analog_intercom":{"name":"Analog intercom","description":"An intercom telephone that consists of an analog switch and a network."},"apb":{"name":"APB (Anti-passback)","description":"A structural method used to control access. This function uses access control devices installed both inside and outside the door, so that authentication is required for access to the zone. In the case of card-based access control systems, if a person enters a zone following the person in front without swiping their card on the reader, the door does not open when the person attempts to leave the zone, and subsequently an <b>anti-passback</b> event occurs.<br/><b>Anti-passback</b> is categorized into hard APB and soft APB. If the <b>anti-passback</b> is violated, the <b>anti-passback</b> event is created immediately and hard APB does not permit access to the user while soft APB still permits access to the user."},"alarm":{"name":"Alarm","description":"Among events occurred in the system, the type of event that requires action without delay."},"alarm_action":{"name":"Alarm action","description":"The actions that automatically perform activities such as controlling the device and sending emails when an alarm or a certain event occurs."},"password":{"name":"Password","description":"A string that an individual uses together with their user ID for authentication."},"encryption":{"name":"Encryption","description":"The act of transforming information so that it is impossible to recognize its original meaning. Storing or transferring information in encrypted form is a way of protecting the information."},"encryption_key":{"name":"Encryption Key","description":"A certain bit string generated for encryption. Encryption keys are designed using algorithms that prevent guessing. Generally, longer encryption keys make decryption more difficult."},"access_on_card":{"name":"Access on Card","description":"A card on which information about a user’s ID, credential, and access group is recorded."},"face_detection":{"name":"Face detection","description":"A function that, after a user\'s credential has been verified, takes a picture of the user\'s face before granting them access so that the event and an image of the user\'s face can be stored together. Authentication fails if the user\'s face is not detected. When an image of a user\'s face has been stored, if necessary, it is possible to identify the user by comparing the image of the face with the user ID that was recorded when the event occurred."},"face_recognition":{"name":"Face authentication","description":"A technology and authentication system that identifies people based on their facial features."},"upgrade":{"name":"Upgrade","description":"The act of enhancing the performance of hardware or software by replacing the existing product with a newer or improved version."},"epoxy_potted":{"name":"Epoxy potted","description":"A material that protects the circuitry by preventing rainwater from entering the device if the device is installed outdoors."},"live_face_detection":{"name":"Live Face Detection(LFD)","description":"A technology that detects forged faces, e.g., masks and photographs."},"fake_fp":{"name":"Fake fingerprint","description":"A fake fingerprint made from paper, silicone, rubber, etc. to emulate another individual\'s fingerprint."},"live_fp_detection":{"name":"Live Finger Detection(LFD)","description":"A technology that detects Fake fingerprint copied using rubber, silicone, clay, glue, film, and so on."},"floating_shift":{"name":"Floating Shift","description":"One of the attendance rules provided by BioStar. This method does not involve preset arrival and exit times, but instead applies the attendance rules of the day according to the user\'s arrival time."},"ridge":{"name":"Ridge","description":"A ridge is a curve that represents a fingerprint, consisting of a continuous curve, an end point where the ridge is cut midway through, and a bifurcation where two ridges meet, which are called minutiae."},"voice_prompt":{"name":"Voice prompt","description":"A function that introduces available options to users using the recorded voice."},"api":{"name":"API (Application Programming Interface)","description":"An API is a set of protocols, tools, and instruction for implementing software applications. In case of web application development, the API specifies how the system should send requests and what kind of corresponding responses should be expected to receive. The API may include functions like file managements, window/video/character processing to ease the application development process for the 3rd party application developers."},"event":{"name":"Event","description":"An interaction between a user, the device, and the door. Events are recorded in a log on the BioStar server. They include authentication successes and failures and changes to the status of the door, alarms, etc."},"dual_auth":{"name":"Double mode","description":"An authentication method where the credentials of two different individuals are entered in sequence in a limited amount of time."},"auth":{"name":"Authentication","description":"The act of verifying the credentials entered by a user to identify the user."},"auth_mode":{"name":"Authentication mode","description":"A combination of credentials required for authentication."},"interlock_zone":{"name":"Interlock Zone","description":"A zone between two or more doors. In this zone, if one door is open or has been unlocked, the rest of the doors will be locked. This zone is generally applied to laboratories and manufacturing facilities where suspended particulate matter in the air such as dust needs to be controlled, or places where this is required for security and safety reasons."},"intercom":{"name":"Intercom","description":"A communication system that is generally installed in a building or institution by using a Private Branch eXchange (PBX)."},"batch_enrollment":{"name":"Batch enrollment","description":"The act of registering a multiple number of access cards on the BioStar server. Registered entry cards can be allocated to individual users."},"dst":{"name":"Daylight Saving Time(DST)","description":"Also called summer time, DST is the practice of moving the clocks forward a certain amount of time from standard time for the purpose of saving energy through more efficient use of the daytime in the summer."},"io_device":{"name":"I/O device","description":"A device that performs an information input/output function."},"lock":{"name":"Lock","description":"An electro-mechanical device that connects to the access control system to be used for locking the door. It refers to all electronic devices either built into or fitted to the door."},"held_open":{"name":"Held open","description":"A status in which the door has remained open longer than maximum set time. Can trigger an alarm."},"device":{"name":"Device","description":"An access control device that can be controlled in the BioStar."},"device_id":{"name":"Device ID","description":"A unique number given to identify each hardware device in the BioStar."},"restart":{"name":"Restart","description":"The act of switching off and on by force due to an error related to program execution during device operation."},"ble":{"name":"BLE(Bluetooth Low Energy)","description":"A Bluetooth technology that can transmit and receive low-power, low-volume data within a distance of about 10 m by using the 2.4 GHz frequency band. Low-power Bluetooth technology is mainly applied to small devices where the supply of power is limited due to low power consumption. It is also used in access control in the form of mobile ID cards."},"cde":{"name":"CDE(Conformance Decision Engine)","description":"One of the procedures for Suprema\'s fingerprint matching algorithm. This is a step that determines whether the obtained fingerprint image is valid prior to processing the fingerprint image and extracting the minutiae of the fingerprint."},"contact_card":{"name":"Contact card","description":"A card with a gold or silver chip attached to the surface. For data transmission, a contact card must be inserted into a card terminal in order to place the chip in direct contact with the card terminal."},"termination":{"name":"Termination resistor","description":"This resistor is connected to the end of a daisy chain to prevent signal reflections and maintain signal quality in RS-485 communication. It reduces communication errors and ensures reliable data transmission."},"intelligent_reader":{"name":"Intelligent card reader","description":"Device that stores user and access information and authenticates entered credentials to authorize user access."},"fp":{"name":"Fingerprint","description":"The curved patterns observed on the fingertips."},"fp_sensor":{"name":"Fingerprint sensor","description":"In fingerprint recognition technology, the image input device that obtains the image information of fingerprints that each represent the unique characteristics of an individual or the area on which a finger is placed, so that the fingerprint scanner can read the fingerprint."},"fp_scanner":{"name":"Fingerprint scanner","description":"A device that scans users\' fingerprints to register them on the database."},"fp_recognition":{"name":"Fingerprint recognition","description":"A technology and authentication system that recognizes people based on the image information of fingerprints that are unique to individuals."},"fp_scan_timeout":{"name":"Scan timeout","description":"The time limit for entering fingerprint information."},"fp_template":{"name":"Fingerprint template","description":"A collection of fingerprint information that consists of a series of minutiae, such as the bifurcations and the end points of ridges observed in fingerprint images. Fingerprint templates are used for the identification of fingerprints, which is carried out by comparing the locations and number of minutiae."},"stp":{"name":"Shielded twisted pair","description":"A cable wrapped in shielding to block external noise and reduce electrical signal interference. It is mainly used in factories or outdoors with significant signal interference, or where high-speed communication is required."},"clean_room":{"name":"Clean room","description":"A space where suspended particulate matter in air such as dust, viruses, metal powders, and cells can be controlled as required."},"initialize_reset":{"name":"Reset","description":"The act of restoring the settings of hardware, software, etc. to the specified default values."},"mtu":{"name":"MTU (Maximum Transmission Unit)","description":"The maximum amount of packets that can be transmitted through the network."},"msb":{"name":"MSB (Most Significant Bit)","description":"The bit at the highest position of binary data (the left-most bit) or its content. It is the opposite of the Least Significant Bit (LSB)."},"lsb":{"name":"LSB (Least Significant Bit)","description":"The bit at the lowest position of binary data (the right-most bit) or its content. It is the opposite of the Most Significant Bit (MSB)."},"punch_in":{"name":"Punch in","description":"The act of recording the time of arrival at the workplace."},"output_relay":{"name":"Output relays","description":"An electronically controlled device that opens/closes electrical contacts in order to affect other devices."},"access":{"name":"Access","description":"The act of accessing a particular zone or particular assets."},"access_rule":{"name":"Access Rule","description":"A rule concerning access to a certain door/door group during a scheduled period of time."},"access_group":{"name":"Access group","description":"A user group that has the right to access a specified door/door group during a scheduled period of time."},"access_level":{"name":"Access level","description":"The right to access the door during a scheduled period of time."},"entrance_limit_zone":{"name":"Entrance Limit Zone","description":"A zone that restricts access at specific times. This zone can be configured in such a way as to restrict the authentication or the authentication count."},"access_control":{"name":"Access control","description":"The act of restricting unauthorized people from accessing the infrastructure and assets. Access made by authorized individuals is recorded in the log."},"door":{"name":"Door","description":"A place in which a physical device for access control is installed. A spatial concept that forms the basis for access control."},"door_group":{"name":"Door group","description":"A group of doors created for ease of management. Events can be monitored by the door group. A component of an access group."},"door_sensor":{"name":"Door sensor","description":"A sensor that detects the state of the door. There are various types of states such as open, closed, held open, and forced open that can be checked."},"card":{"name":"card","description":"A portable information medium in the form of a card. It stores information for identification."},"card_id":{"name":"Card ID","description":"A serial number given to a card according to the format defined by a company, organization, or department. A card ID can be either given by the card manufacturer or created in a format defined by a particular company or organization."},"card_layout":{"name":"Card layout","description":"The data arrangement and structure inside a card."},"card_mode":{"name":"Card mode","description":"A method for authenticating cardholders. There are two card modes, Card ID mode and Template-on-Card mode. The Card ID mode compares the user ID that is stored on the device with fingerprint information, in reference to the card ID stored on the card. Whereas the Template-on-Card mode identifies a user by checking whether the fingerprint entered by the user matches the fingerprint information on the card."},"csn":{"name":"CSN (Card Serial Number)","description":"A serial number given to a card by the manufacturer."},"card_reader":{"name":"Card reader","description":"A device that reads the information stored on cards and transmits it to the controller."},"kernel":{"name":"Kernel","description":"A core component of an operating system. It manages important resources such as the memory and processes. It is loaded onto the memory at boot time to provide various basic services."},"controller":{"name":"Controller","description":"A device that examines access rights based on credential information obtained from a reader and controls the input and output of the reader."},"credential":{"name":"Credential","description":"Data used to identify users. Digital signatures, smart cards, biometric data, user names, passwords, etc. are common examples of credentials."},"client":{"name":"Client","description":"Entity that requests service from the server through a network."},"far":{"name":"FAR (False Acceptance Rate)","description":"Criteria used when comparing the accuracy of different biometric systems. It represents the probability of incorrectly recognizing a non-registered person as a registered person."},"transaction":{"name":"Transaction","description":"A transaction is a unit of work that consists of data retrieval, updates, and other operations. In order to prevent using temporarily unmatched data from updates, a transaction is processed all at once. ACID Properties should be satisfied when a transaction is used."},"tamper":{"name":"Tamper","description":"A method for monitoring the device status. A tamper can be set so that, if the device is dislocated from the bracket on which it is installed due to external factors, an alarm is activated, or the event is recorded on the server."},"tailgating":{"name":"Tailgating","description":"As one method of unauthorized access using fraudulent authentication, it refers to the act of a person who does not have access rights to a restricted area entering by following the person in front. It is also known as \'two-person entry\', and is one of the most representative methods of unauthorized access along with <b>Piggybacking</b>. Generally, <b>Tailgating</b> refers to unauthorized access without intent, while <b>Piggybacking</b> refers to unauthorized access with intent."},"template":{"name":"Template","description":"The stored data created from extracting and then encoding biometric features. It is used to identify a user by comparing it with the bio sample entered by the user in a biometrics system or on a biometrics device."},"template_on_card":{"name":"Template-on-Card","description":"A method used to store the user information and fingerprint template on a smart card."},"punch_out":{"name":"Punch out","description":"The act of recording the time of departure from the workplace."},"exit_button":{"name":"Exit button","description":"A button used to open the door. Pressing this button opens the door. The button can be used for doors and zones that do not require separate authentication."},"trigger_action":{"name":"Triggered action","description":"The actions that automatically perform activities such as controlling the device and sending emails when an alarm or a certain event occurs."},"minutiae":{"name":"Minutiae","description":"The specific details in the ridges of a fingerprint used to recognize the fingerprint."},"tilting_bracket":{"name":"Tilting bracket","description":"Bracket with adjustable angle. It is primarily used with facial authentication or iris recognition devices."},"firmware":{"name":"Firmware","description":"A micro program or file stored on a ROM to control the hardware of the product."},"port_number":{"name":"Port number","description":"The port number used for intercommunication in TCP/UDP. Its range is from 0 to 65535."},"timezone":{"name":"Time zone","description":"A geographical zone that uses the same time standard. It can be used to set the time of the device or BioStar for controlling access."},"protocol":{"name":"Protocol","description":"Communication rules used to exchange data between systems or terminals."},"piggybacking":{"name":"Piggybacking","description":"As one method of unauthorized access using fraudulent authentication, it refers to the act of a person who does not have access rights to a restricted area entering by following the person in front. It is also known as \'Piggybacking\' or \'Piggyback\', and is one of the most representative methods of unauthorized access along with <b>Tailgating</b>. Generally, <b>Tailgating</b> refers to unauthorized access without intent, while <b>Piggybacking</b> refers to unauthorized access with intent."},"bypass_card":{"name":"Bypass card","description":"A card that enables access to a specific zone by bypassing the authentication process. For example, people who possess this card can pass through the door without the need to go through a series of security (authentication) procedures."},"grace":{"name":"Grace","description":"Allowable time for time and attendance rules. For instance, if you set the work start time to 9:00 and the allowable time to 10 minutes, personnel who have arrived between 9:00 and 9:10 are not deemed to have been late for work."},"duress":{"name":"Duress finger","description":"A fingerprint chosen to generate a certain event upon fingerprint registration. If a user authenticates himself/herself with such a fingerprint, the authentication gets recorded in a log as duress fingerprint authentication. The system administrator can set a separate alarm using the log."},"fire_alarm_zone":{"name":"Fire alarm zone","description":"A zone set to open or lock all the doors or elevators located within it in the event of a fire."},"vacation":{"name":"Leave","description":"The act of taking a leave of absence from work with a pre-specified reason/permission or the period of leave itself."},"break":{"name":"Break","description":"A brief time taken off for rest during working hours. Each break is calculated as the time between the start and the end of the break."}}')
;// CONCATENATED MODULE: ./i18n/ja/glossary.json
var ja_glossary_namespaceObject = JSON.parse('{"onetoone_auth":{"name":"1:1認証","description":"ユーザ自身を確認する認証方式です。個人のバイオ情報をデータベースに保存されているバイオ情報と1対1で照合して検証します。"},"onetomany_auth":{"name":"1:N認証","description":"データベースからユーザ情報を検索する認証方式です。個人のバイオ情報を登録されているすべてのデータベース情報と比較して識別します。"},"acid":{"name":"ACID特性","description":"データベースに対して<b>原子性（Atomic）</b>、<b>一貫性（Consistent）</b>、<b>分離性（Isolated）</b>、<b>耐久性（Durable）</b>を備えるべきトランザクションの特性です。<ul><li><b>原子性</b>はこれ以上分割できない作業単位として、トランザクション内のすべての段階が全て成功するか失敗するかのいずれかでなければならない特性</li><li><b>一貫性</b>はデータベースを1つの安定した状態から別の安定した状態へ移行させなければならない特性</li><li><b>分離性</b>は任意のトランザクションが同時に実行される他のトランザクションに影響を与えてはならない特性</li><li><b>耐久性</b>はデータベースの完全性を維持するために再構成できるよう、ログをドライブに保持しなければならない特性</li><ul>"},"ad_hoc":{"name":"アドホックネットワーク","description":"基地局やアクセスポイントなどのネットワーク基盤構造に依存せず、それぞれのデバイスによって自律的に構成されるネットワークです。各デバイスは無線インターフェースで通信しますが、ルーティング機能によって無線通信の距離的制約を克服し、各デバイスの移動が自由であるため、動的かつ自律的なネットワークトポロジを形成できます。"},"ansi378":{"name":"ANSI 378","description":"アメリカ規格協会（American National Standards Institute, ANSI）が定義した指紋テンプレート標準です。"},"dhcp":{"name":"DHCP","description":"動的ホスト構成プロトコル（Dynamic Host Configuration Protocol, DHCP）は、TCP/IP通信に必要な設定情報を自動的に割り当てて管理するための通信プロトコルです。"},"dip_switch":{"name":"DIPスイッチ（Dual-inline Package Switch）","description":"ハードウェアを変更することなく、ユーザーが基板上で機能を任意に選択できるオンオフスイッチです。"},"fail_safe_lock":{"name":"Fail Safe Lock","description":"電源が遮断されると安全状態に切り替わる錠装置です。火災などで出入口に供給される電源が遮断された際に、ロックが解除されてドアを開放できるよう設計されています。"},"fail_secure_lock":{"name":"Fail Secure Lock","description":"電源が遮断された際にドアが自動的に施錠されるセキュア状態へ切り替わる錠装置です。銀行のようにセキュリティが重要な場所で、電源が遮断されたときに出入口を施錠して安全を維持できるよう設計されています。"},"fastcgi":{"name":"FastCGI","description":"Webサーバーとプログラム間でデータを交換するためのプロトコルです。従来の共通ゲートウェイインターフェース（Common Gateway Interface, CGI）を改良し、1つのプロセスで複数のCGIリクエストを処理できるよう設計されており、性能を大幅に向上させたインターフェースです。"},"hf_card":{"name":"HFカード","description":"13.56MHz帯で読み取りと書き込みの両方が可能な電子カードで、スマートカードの一種です。特定のリーダーのみが読み取れるように設定したり、データを暗号化したりするなど、さまざまなセキュリティ機能を適用できます。"},"http":{"name":"HTTP（HyperText Transfer Protocol）","description":"Webブラウザを利用してWebクライアントとWebサーバーがデータをやり取りするプロトコルを指します。"},"https":{"name":"HTTPS（HyperText Transfer Protocol over Secure Socket Layer）","description":"HTTPよりもセキュリティを強化したプロトコルを指します。HTTPSで送受信されるすべてのデータは暗号化の過程を経るため、HTTPに比べて優れた安全性を備えています。"},"ic_card":{"name":"ICカード","description":"半導体ベースの集積回路を内蔵したカードで、スマートカードの一種です。データの読み取りと書き込みが可能で、磁気カードに比べて大容量のストレージと優れた耐久性を提供します。磁石との接触でもデータの損傷がなく、特定規格のリーダーと互換するよう設定したりデータを暗号化したりするなど、さまざまなセキュリティ機能をサポートして高い安全性と機能性を備えています。"},"ik_rating":{"name":"IK（Impact Protection）等級","description":"物理的衝撃に対する製品保護の程度を規定した国際等級です。「K」はKineticを意味します。"},"io":{"name":"I/O","description":"入力（Input）と出力（Output）の略語です。コンピュータおよび周辺機器でデータを送信するプログラム、オペレーション、または装置を指します。"},"ip_rating":{"name":"IP（Ingress Protection）等級","description":"固体および液体に対する製品保護の程度を規定した国際等級です。"},"iso19749-2":{"name":"ISO 19749-2","description":"指紋の細かな特徴点を利用して指紋情報を表現したISO国際指紋データ形式です。詳細は<a href=\'https://www.iso.org/standard/50864.html\' target=_blank>次のリンク</a>を参照してください。"},"json":{"name":"JSON（JavaScript Object Notation）","description":"データを保存および転送するためのシンプルな文字ベースの標準フォーマットです。複雑なオブジェクト間の関係を文字、括弧、記号だけで表現でき、PHP、C#、Pythonなど多くのプログラミング言語で利用できます。"},"lan":{"name":"LAN","description":"近距離通信網（Local Area Network, LAN）は、建物など限られたエリア内にあるコンピュータ、プリンター、その他のデバイスを通信線で接続して相互にやり取りできるネットワークシステムです。LANは一般的にイーサネットケーブルで接続され、Wi-Fiなどの無線ネットワークも含まれます。"},"lf_card":{"name":"LF（Low Frequency）カード","description":"120〜140kHz帯を使用する低周波の電子カードです。"},"nc":{"name":"NC（Normally Closed）","description":"通常状態ではリレーが閉じていますが、デバイスが動作すると開く動作を意味します。初期状態でリレーが閉じているため、接続された回路に電流が流れています。"},"no":{"name":"NO（Normally Open）","description":"通常状態ではリレーが開いていますが、デバイスが動作すると閉じる動作を意味します。初期状態でリレーが開いているため、接続された回路に電流が流れません。"},"nvr":{"name":"NVR（Network Video Record）","description":"ネットワーク上に設置されたカメラや映像機器から送られてくる映像を録画・モニタリングし、発生したイベントを管理できる機能です。"},"osdp":{"name":"OSDP（Open Supervised Device Protocol）","description":"リーダーからコントローラーへの一方向通信しかできなかったWiegandインターフェースを補完するために開発されたRS-485標準プロトコルです。リーダーとコントローラー間で双方向通信が可能な環境において大容量データを処理でき、バイオメトリクスデータも送信できます。このプロトコルをサポートしている場合、他社デバイスとも接続できるため、既存システムで交換が必要な項目だけを置き換えて利用できます。"},"poe":{"name":"PoE（Power over Ethernet）","description":"イーサネットケーブルを介して機器に電力を供給するシステムです。1 本のケーブルで機器へデータを送信しながら電力も供給できるため、設置と拡張が容易で配線コストを削減できます。"},"rest":{"name":"REST（Representational State Transfer）","description":"Web ベースのシステムでリソースを定義し、HTTP メソッド（GET、POST、PUT、DELETE など）で処理するアーキテクチャスタイルです。シンプルで一貫したインターフェースを提供し、クライアントとサーバー間の相互作用を効率化します。"},"rf":{"name":"RF（Radio Frequency）","description":"無線周波数を意味し、遠距離または近距離で情報を認識または送信するために用いる電磁波です。主に通信、RFID 技術、無線ネットワークなど多様な分野で活用されます。"},"rfid":{"name":"RFID（Radio-Frequency Identification）","description":"RF（Radio Frequency）を利用して ID を認識し識別する技術です。アンテナとチップで構成された RFID タグに情報を保存し、それを RFID リーダーで読み取って情報を識別します。"},"rfid_tag":{"name":"RFID（Radio-Frequency Identification）タグ","description":"カードなどの物体に貼り付け、人や物の固有識別情報を保存する電子タグです。RFID リーダーは電波を用いてタグに保存された情報を無線で認識します。RFID タグは一般的に小型プロセッサ、メモリ、小型アンテナ、バッテリーなどで構成され、読み書きの可否、電池内蔵の有無、RF（Radio Frequency）周波数帯域などによってさまざまな種類に分類できます。"},"rte":{"name":"RTE（Request To Exit）ボタン","description":"内部から出入口ドアを開けるためのボタンです。このボタンを押すとドアが開き、退室時に追加認証が不要なドアやエリアで使用できます。"},"rs485":{"name":"RS-485","description":"ホームネットワークをサポートする一種のシリアル通信プロトコル規格です。RS-232 は伝送速度が低く伝送距離が短いのに対し、RS-485 は長距離伝送と高い信頼性を提供します。すべてのデバイスが 1 本の通信ラインでデータを送受信できます。"},"ssl":{"name":"SSL（Secure Socket Layer）","description":"Web クライアントと Web サーバーがネットワークで通信する際に、セキュリティとデータ完全性を確保するために使用する暗号化規格を指します。"},"tcpip":{"name":"TCP/IP","description":"転送制御プロトコル／インターネットプロトコル（Transmission Control Protocol/Internet Protocol、TCP/IP）はコンピューター間の通信プロトコルです。TCP はデータ転送用プロトコル、IP はネットワークアドレス指定用プロトコルです。TCP/IP はインターネットのような大規模ネットワークでデータを送信する際に使用されます。"},"tls":{"name":"TLS（Transport Layer Security）","description":"Web クライアントと Web サーバーがネットワークで通信する際に、セキュリティとデータ完全性を確保するために使用する暗号化規格を指します。"},"uhf":{"name":"UHF（Ultra High Frequency）","description":"極超短波（Ultra High Frequency）は周波数が 300～3,000MHz に属する電磁波です。衛星放送、携帯電話などの移動通信、地上デジタル TV、航空無線、RFID 技術など多様な通信分野で使用されます。高い周波数により 1～10cm の短い波長を持ち、直進性が強いという特徴があります。"},"voip":{"name":"VoIP（Voice over Internet Protocol）","description":"インターネットプロトコル（Internet Protocol、IP）網を基盤として音声通話を提供する通信技術です。VoIP は音声をデジタル信号に変換してインターネットを通じて送信し、一般電話網より低コストで通話できます。"},"wiegand":{"name":"Wiegand","description":"Wiegand は 2 本の信号線（DATA0、DATA1）を用いてデータを送信する通信方式です。主に入退室管理システムでリーダーとコントローラー間の通信に使用され、簡易な構造と低コストで実装できます。ただし、伝送距離が短くデータ転送速度が遅いという制限があります。"},"import":{"name":"インポート","description":"他のコンピューターシステムまたはプログラムからデータを自システムに読み込むことを意味します。"},"audit_trail":{"name":"監査トレイル​","description":"システムの変更情報を記録したデータです。ユーザーの許可されていない行為や処理過程の情報を調査できます。"},"forced_open":{"name":"強制ドア開放","description":"ユーザー認証や退室ボタンなど通常の出入イベントがない状態で、ドアセンサーがドア開放を検知した場合です。"},"private_auth":{"name":"個別認証","description":"管理者が指定したクレデンシャルの組み合わせに従ってユーザーを認証する方式で、他の認証方式より優先されます。"},"pin":{"name":"個人識別番号（Personal Identification Number、PIN）","description":"本人確認のために個人に付与される個別識別番号です。"},"alert":{"name":"アラーム","description":"システムで発生したアラーム（Alarm）イベントをリアルタイムで表示または通知する動作です。"},"arm":{"name":"警備開始","description":"犯罪や安全事故を防止するため、特定エリアを監視する動作です。セキュリティシステムを通じて 24 時間監視、警報通知、録画などが行えます。"},"intrusion_alarm_zone":{"name":"警備ゾーン","description":"警備開始後に許可されていない人物が侵入を試みると警告音を出したりリレー信号を出力するよう設定されたゾーンです。主に業務終了後に警備を開始し、警備開始後に出入を試みると設定されたアラームや信号を出力します。"},"disarm":{"name":"警備解除","description":"特定エリアの警報システムの稼働を停止する動作です。"},"zone":{"name":"エリア","description":"出入規則の適用対象となるデバイスグループです。イベントをモニタリングするために使用します。"},"aes":{"name":"高度暗号化標準（Advanced Encryption Standard、AES）","description":"米国国立標準技術研究所（National Institute of Standards and Technology、NIST）が作成したデータ暗号化標準（Data Encryption Standard、DES）に代わる次世代の国際標準暗号アルゴリズムです。"},"administrator":{"name":"管理者","description":"すべての設定権限を持つユーザーです。"},"optical_fp_sensor":{"name":"光学式指紋センサー","description":"光を利用して指紋情報を検出するセンサーです。"},"graphic_map":{"name":"グラフィックマップ","description":"BioStar が提供するモニタリング方式の一つで、図面上でドアの状態をリアルタイムに確認および制御できる機能です。"},"nfc":{"name":"近距離無線通信（Near Field Communication、NFC）","description":"モバイル端末に搭載し、近距離で双方向データ送受信をサポートする RFID 技術です。スマートフォンの普及に伴い金融、通信などさまざまな分野で利用され、入退室管理分野でもモバイル ID カードの形で活用されています。"},"tna":{"name":"勤怠","description":"出勤と退勤を含め、従業員の勤務時間に関する情報を収集および追跡する管理機能です。"},"tna_rule":{"name":"勤怠規則","description":"従業員の勤務時間を把握・管理するために管理者が定義した規則です。"},"tna_event":{"name":"勤怠イベント","description":"従業員の勤怠状況を示すイベントです。従業員の出入時刻を記録し、特定期間の勤務時間を計算します。"},"global_zone":{"name":"グローバルゾーン","description":"サーバーとマスター装置が TCP/IP で接続され、マスター装置とスレーブ装置が RS-485 通信で接続されて通信するゾーンです。このゾーンのマスターとしての役割はサーバーが担います。"},"payroll_sys":{"name":"給与システム","description":"従業員の勤務時間や勤怠、その他の税金などの要素に基づいて総賃金を計算し、正確な給与を支給するためのシステムです。"},"export":{"name":"エクスポート","description":"特定形式のデータを使用するプログラムが、自身のデータを他のプログラムが利用できる形式で保存する操作です。"},"noise":{"name":"ノイズ（Noise）","description":"信号を曖昧にしたり識別しにくくする電気的信号です。"},"direct_mode":{"name":"ダイレクトモード（Direct mode）","description":"BioStar クライアントで接続可能なデバイスを直接検索して接続する方式です。クライアントがデバイスおよびサーバーとの通信を担当します。サーバーでデバイスを検索すると、接続可能なデバイスの一覧が表示され、管理者はその一覧から接続するデバイスを選択できます。"},"diode":{"name":"ダイオード","description":"電流が一方向にのみ流れるよう制御する部品です。ドアロックが動作する際に瞬間的に発生する逆電流を防ぐために使用します。"},"short":{"name":"短絡","description":"配線が短絡した状態です。一般的に配線の損傷や過電流によって発生します。"},"open":{"name":"断線","description":"配線が切れて回路が開放され、電流が流れない状態です。"},"bandwidth":{"name":"帯域幅","description":"特定の機能を実行できる周波数の範囲で、ヘルツ（Hz）単位で測定します。一定時間に配線や他の媒体を通じて送信できる情報量を指します。周波数の帯域幅が広いほど、同じ時間内により多くの情報を送信できます。"},"dummy_reader":{"name":"ダミーリーダー（Dummy Reader）","description":"ユーザーデータの保存や判定は行わず、顔・指紋・カードなどのクレデンシャルデータを読み取り、コントローラへ送信するだけの装置です。"},"daisy_chain":{"name":"デイジーチェーン（Daisy Chain）","description":"デイジーチェーンとは、連続的に接続されたハードウェア機器の構成を指します。"},"dbms":{"name":"データベース管理システム（DataBase Management System, DBMS）","description":"データベースを操作するソフトウェアです。データベース管理システムがデータベースを管理し、アプリケーションやユーザーがデータベースにアクセスしてデータを利用できるようにします。"},"door_contact":{"name":"ドアコンタクト（Door Contact）","description":"入退室ドアセンサーの別称です。ドアの現在の状態（閉／開）を確認するための磁気センサーです。"},"synchronization":{"name":"同期","description":"異なるシステムやネットワークで時間や情報などを一致させる操作です。"},"eer":{"name":"等誤差率（Equal Error Rate, EER）","description":"バイオ認識性能の指標であり、他人受入率（誤受入率）と本人拒否率（誤拒否率）が一致する点の他人受入率（誤受入率）を指します。一般的に、等誤差率が低い装置ほど精度が高いとされます。"},"enrollment":{"name":"登録","description":"ユーザーのバイオ情報をバイオ認識システムに保存するための一連の手順です。サンプル収集、テンプレート生成および保存などが含まれます。"},"log":{"name":"ログ（Log）","description":"システム、ネットワーク、装置、ドアなどで発生するすべてのイベントの記録です。"},"local_zone":{"name":"ローカルゾーン","description":"デバイス間の RS-485 通信を利用して設定されたゾーンで、そのゾーンのマスター役はサーバーではなくマスター装置が担います。"},"relay":{"name":"リレー（Relay）","description":"電気回路の開閉を、別の電気回路の電流・電圧・周波数などの変化に応じて自動で行う制御機器です。"},"mag_card":{"name":"マグネチックカード","description":"磁気テープの磁性を変化させてデータを記録するカードです。カード片面の磁気テープをカード端末で読み取り、データを送信します。容量が小さく保存できるデータの種類も限られ、磁石に触れると記録データが変質または損傷する恐れがあります。さらに、データを暗号化しないためセキュリティが低く、出入管理分野だけでなくさまざまな分野で IC カードへの置き換えが進んでいます。"},"master_device":{"name":"マスター（Master）装置","description":"RS-485 で接続された装置のうち、コントローラの役割を果たす装置です。スレーブ装置を定期的に監視してデータを処理します。ホスト（Host）装置とも呼ばれます。"},"matching_timeout":{"name":"マッチングタイムアウト（Matching Timeout）","description":"デバイスまたはサーバーのマッチングに与えられる制限時間です。時間内にマッチングが完了しない場合、マッチングは失敗となります。"},"man_trap":{"name":"マン・トラップ（Mantrap）","description":"不正な入室を防ぎ、非セキュリティエリアとセキュリティエリアを分離するための物理的な入退室管理システムです。"},"multi_rfid":{"name":"マルチ RFID カード技術","description":"125kHz、13.56MHz など異なる帯域の周波数カードを 1 台の装置で読み取る技術です。"},"message_timeout":{"name":"メッセージ表示タイムアウト","description":"ユーザーの操作がない場合にメッセージが画面に表示される時間です。"},"monitoring":{"name":"モニタリング（Monitoring）","description":"特定目的のための監視活動です。出入管理および勤怠管理におけるモニタリングは、出入イベントやユーザーの勤怠イベントを確認したり、装置・ドア・ゾーンの状態をリアルタイムで確認および制御することを意味します。"},"model_number":{"name":"モデル番号","description":"メーカーが装置識別のために付与した固有番号です。"},"mobile_card":{"name":"モバイルカード","description":"ユーザーおよびクレデンシャルデータをモバイル端末に保存し、NFC または BLE 技術を用いて認証を行うカードです。モバイルカードはプラスチックカードに比べて高いセキュリティと利便性を両立でき、ほぼすべての人が日常的に使用するモバイル機器を利用することでカード発行および管理コストを削減できる利点があります。"},"wlan":{"name":"無線 LAN","description":"無線周波数（RF）技術を利用した近距離ネットワークです。無線アクセスポイント（AP）が設置された場所を中心に、一定距離内で WLAN カードを搭載した端末を使ってネットワークを利用できます。"},"access_point":{"name":"無線アクセスポイント（Access Point, AP）","description":"無線 LAN を構築するための中継装置です。有線 LAN を介して無線ネットワークに接続する役割を担います。"},"brute_attack":{"name":"ブルートフォース攻撃（Brute-Force Attack）","description":"「ブルートフォース攻撃（Brute-Force Attack）」とも呼ばれ、パスワードを解読するために可能な限りすべての値を無作為に試行することを指します。"},"ups":{"name":"無停電電源装置（Uninterruptible Power Supply system、UPS）","description":"停電などで主電源の供給が途絶えた際に、内蔵バッテリーを用いて一定時間デバイスに非常用電源を供給する装置です。通信・放送・医療施設、データセンター、基幹施設など電源の安定供給が必須となる施設で主に使用されます。"},"biometric_information":{"name":"バイオメトリック情報","description":"個人の身元を識別できる情報です。個人が持つ固有の身体的・行動的特徴を指し、指紋、署名、静脈パターン、顔、音声、虹彩、DNA などを意味します。"},"biometrics":{"name":"生体認証","description":"人の身体的・行動的特徴を自動化されたデバイスで抽出・分析し、個人の身元を確認する技術です。生体認証とも呼ばれます。"},"biometric_auth":{"name":"バイオ認証","description":"個人のバイオメトリック情報とデータベースに保存された当人のバイオメトリック特徴を比較し、一致の有無を判定する技術です。"},"semiconductor_fp_sensor":{"name":"半導体式指紋センサー","description":"多数のセンサーを半導体上に配置し、指紋情報を電気的に検出するセンサーです。"},"waterproof":{"name":"防水","description":"雨天や浸水などによりデバイス内部に液体が入り込み、機能へ影響を与えることを防止する処理方式です。"},"firewall":{"name":"ファイアウォール","description":"個人および組織の PC が使用するネットワークに、許可されていない外部者がアクセスして情報を流出させたりシステムを破損させたりすることを防止するセキュリティシステムです。ファイアウォールは外部インターネットと内部専用ネットワークの境界に位置し、外部からのアクセス試行を定められたアクセス制御リストに従って許可または遮断します。"},"backlight":{"name":"バックライト（Backlight）","description":"液晶表示装置の視認性を確保するため、液晶の背面から照射する照明です。"},"backlight_timeout":{"name":"バックライトタイムアウト（Backlight timeout）","description":"バックライトが点灯してから維持される時間です。"},"parallel_port":{"name":"パラレルポート","description":"並列インターフェースを介してデータを同時に送信する方式の入出力コネクターです。"},"security_level":{"name":"セキュリティレベル","description":"ユーザーの身元確認に必要な指紋の一致度です。セキュリティレベルが高いほど本人拒否率が高くなる場合があります。"},"secure_tamper":{"name":"セキュリティタンパー","description":"デバイスがブラケットから分離されタンパーが発生した場合に、デバイスに保存されているユーザー、ログ、暗号鍵、SSL 証明書などすべての情報を即時に削除する機能です。"},"decryption":{"name":"復号","description":"暗号化されたデータを復号鍵を用いて元の状態に戻す処理方式です。暗号化データは、暗号化に使用した鍵と対になる対称鍵でのみ復号できます。"},"frr":{"name":"本人拒否率（過拒否率、False Rejection Rate、FRR）","description":"バイオメトリックシステムの精度を比較する際に用いられる指標で、登録者を未登録者として認識する確率です。"},"leave_manage":{"name":"不在管理","description":"休暇、出張、外出、外勤などによる労働者の不在を管理するプロセスです。"},"bifurcation":{"name":"分岐点","description":"2 本の指紋稜線が合流または分岐する点です。"},"blacklist":{"name":"ブラックリスト（Black list）","description":"BioStar デバイスで認証が拒否されるカードのリストです。カードを紛失または盗難された場合、ブラックリストにカード ID を登録して悪用を防止できます。"},"bluetooth":{"name":"Bluetooth（ブルートゥース）","description":"近距離で双方向データ送受信を行う通信技術です。伝送距離、伝送方式、消費電力などによりそれぞれ異なる特徴があります。"},"contactless_card":{"name":"非接触型カード","description":"カードに内蔵されたコイルアンテナを用いてカード端末と通信するカードです。端末と接触することなく磁界を利用してデータを送信できます。"},"user":{"name":"ユーザー","description":"Suprema デバイスを使用する個人を指します。"},"user_id":{"name":"ユーザーID","description":"特定のユーザーを識別するために使用される英数字で構成された固有識別コードです。"},"user_group":{"name":"ユーザーグループ","description":"入退室グループを構成する要素で、管理を容易にするためのユーザー集合です。"},"user_sync":{"name":"ユーザー同期","description":"BioStar サーバーで変更されたユーザー情報を自動的にデバイスへ送信します。"},"weatherproof":{"name":"生活防水","description":"完全防水よりやや低いレベルの防水性能を意味します。"},"server":{"name":"サーバー（Server）","description":"ネットワーク環境でクライアントの要求に応じてサービスを提供するコンピューターまたはシステムです。コンピュータープログラムやデバイスを指す場合もあります。"},"server_matching":{"name":"サーバーマッチング（Server matching）","description":"サーバーに保存されたクレデンシャル情報とユーザーが入力したクレデンシャル情報を比較する機能です。"},"server_mode":{"name":"サーバーモード（Server mode）","description":"サーバーとデバイスを接続する際、デバイス側でサーバー IP アドレスを直接入力する方式です。直接入力方式のため、デバイスが別のサーバーやクライアントに誤接続するリスクがなく、接続が切れた場合でも自動で再接続されるため、安定したネットワーク環境を構築できます。"},"sensor_sensitivity":{"name":"センサー感度","description":"指紋画像を正確に検出できる程度を示します。感度が高いほど指紋画像を取得しやすくなりますが、ノイズへの感度も高くなり、正確な画像検出が難しくなる場合があります。"},"muster_zone":{"name":"集合区域","description":"火災など緊急事態発生時に構成員が集合するよう指定された区域です。特定区域にいる人数と名簿を監視したり、特定区域にユーザーが一定時間以上滞在した場合にアラームや警報で管理者へ通知する目的で使用します。"},"sdk":{"name":"ソフトウェア開発キット（Software Development Kit、SDK）","description":"ソフトウェア開発者が特定のソフトウェアフレームワーク、ハードウェアプラットフォーム、コンピューター向けのアプリケーションを作成できるようにする開発ツールの集合体です。"},"shrink_tube":{"name":"収縮チューブ","description":"熱を加えると収縮するチューブ形状のゴム弾性体です。主に電子製品のケーブルを断線、腐食、浸水などから保護するために使用します。"},"suprema_template":{"name":"Suprema テンプレート","description":"Suprema が定義した指紋テンプレートです。"},"smart_card":{"name":"スマートカード（Smart Card）","description":"13.56 MHz帯で読み取りと書き込みの両方に対応した電子カードで、特定のリーダーだけが読み取れるように設定したり、データを暗号化するなど、さまざまなセキュリティ機能を適用できます。"},"scan":{"name":"スキャン（Scan）","description":"指紋情報をデジタルデータに変換するために、センサー面に指を置く、または一定の速度で指を滑らせる動作を指します。"},"schedule_unlock":{"name":"スケジュール開放","description":"特定エリアのドアをあらかじめ設定したスケジュールに従って解錠する機能です。"},"schedule_lock":{"name":"スケジュールロック","description":"特定エリアのドアをあらかじめ設定したスケジュールに従って施錠する機能です。"},"slave_device":{"name":"スレーブ（Slave）デバイス","description":"RS-485で接続されたデバイスのうち、リーダーまたは入出力機能のみを行うデバイスです。ユーザー情報を保持せず、マスターデバイスによって制御されます。"},"puch":{"name":"打刻","description":"勤務の開始または終了時刻を示すイベントです。"},"time_sync":{"name":"時刻同期","description":"ネットワーク上で異なるデバイスやシステム間の時刻を一致させる機能です。"},"overtime":{"name":"時間外勤務","description":"労働基準法または社内規定で定められた1日の所定労働時間を超えて勤務することで、早出、残業、休日勤務などが含まれます。"},"serial_comm":{"name":"シリアル（Serial）通信","description":"複数ビットを順次送信する通信方式です。代表的なものに RS-232 と RS-485 があります。"},"meal_deduct":{"name":"食事控除","description":"1日の総勤務時間を計算する際に食事時間を除外することを意味します。"},"real_time_log":{"name":"リアルタイムログ","description":"各アクセスポイント（Access Point, AP）でリアルタイムに発生したイベントの記録です。"},"lvv":{"name":"ライブビデオ視聴","description":"ビデオを利用した監視方法の一つです。BioStar では IP カメラの映像とイベントログをリアルタイムで提供し、該当するドアを手動で開閉する機能をサポートしています。"},"analog_intercom":{"name":"アナログインターホン","description":"アナログ交換機と回線網で構成されたインターホンです。"},"apb":{"name":"アンチパスバック（Anti-Passback）","description":"入退室管理のための構造的な方法で、ドアの内側／外側にアクセスコントロール装置を設置し、エリアに出入りする際には必ず認証を通して出入りさせる機能です。カードで入室する際にリーダーにカードをかざさずに前の人に続いて入室した場合、退室時にドアは開かず、<b>アンチパスバック</b>イベントが発生します。<br/><b>アンチパスバック</b>には Hard APB と Soft APB があります。<b>アンチパスバック</b>違反時、Hard APB は<b>アンチパスバック</b>イベントを生成し入室できず、Soft APB は<b>アンチパスバック</b>イベントを生成しますが入室は可能です。"},"alarm":{"name":"アラーム（Alarm）","description":"システムで発生するイベントのうち、リアルタイムで対応が必要なイベント種別です。"},"alarm_action":{"name":"アラームアクション（Alarm action）","description":"アラームや特定イベントが発生した際に、自動でデバイスを制御したりメール送信などを行います。"},"password":{"name":"パスワード","description":"個人がユーザー ID と併せて認証に使用する文字列です。"},"encryption":{"name":"暗号化","description":"元の意味が分からないように情報を変換する処理機能です。暗号化された形で情報を保存または送信することで、情報を保護できます。"},"encryption_key":{"name":"暗号鍵","description":"暗号化のために生成された任意のビット列です。暗号鍵はすべての鍵を予測できないように設計されたアルゴリズムで作られ、一般に鍵が長いほど解読は困難になります。"},"access_on_card":{"name":"アクセスオンカード（Access on Card）","description":"ユーザーの ID とクレデンシャル、入室グループ情報を記録したカードです。"},"face_detection":{"name":"顔検出","description":"デバイスでユーザーのクレデンシャルを検証した後、入室を許可する前にユーザーの顔も撮影し、当該イベントと共に顔画像を保存する機能です。顔が検出されない場合は認証に失敗します。顔画像が保存されている場合、必要に応じてイベント発生時に記録されたユーザー ID と顔画像を比較し、同一人物であることを確認できます。"},"face_recognition":{"name":"顔認証","description":"人の顔の特徴を利用して本人確認を行う技術、またはそのような認証方式です。"},"upgrade":{"name":"アップグレード（Upgrade）","description":"ハードウェアやソフトウェアの性能を従来製品より優れた新しいものに置き換える作業です。"},"epoxy_potted":{"name":"エポキシ（Epoxy）","description":"デバイスを屋外に設置する際、雨水が内部に侵入するのを防いで回路を保護するために用いる素材です。"},"live_face_detection":{"name":"偽造顔検知（Live Face Detection）技術","description":"マスクや写真などの偽造顔を検知する技術です。"},"fake_fp":{"name":"偽造指紋","description":"他人の指紋を模して紙、シリコン、ゴムなどで作成した偽の指紋です。"},"live_fp_detection":{"name":"偽造指紋検知（Live Finger Detection）技術","description":"ゴム、シリコン、粘土、接着剤、フィルムなどで複製された偽造指紋を検知する技術です。"},"floating_shift":{"name":"フローティング勤務","description":"BioStar が提供する勤務規則の一つで、出退勤時刻が定められておらず、ユーザーが出勤した時刻に応じてその日の勤務規則が適用される方式です。"},"ridge":{"name":"リッジ","description":"指紋を構成する一本のパターン線で、連続するリッジと途中で途切れるエンドポイント、2 本のリッジが交わる分岐点で構成され、これらを特徴点（minutiae）と呼びます。"},"voice_prompt":{"name":"音声ガイダンス","description":"利用可能なオプションをユーザーに音声で案内する機能です。"},"api":{"name":"アプリケーションプログラミングインターフェース（Application Programming Interface, API）","description":"Web アプリケーションを開発する際、他のサービスプラットフォームにリクエストを送信し応答を受け取るために定義された仕様です。アプリケーションから利用できるように、オペレーティングシステムやプログラミング言語が提供する機能を制御できるようにしたインターフェースです。主にファイル制御、デバイス制御、画像処理、文字制御などのインターフェースを提供します。"},"event":{"name":"イベント（Event）","description":"ユーザー、デバイス、ドア間で発生する相互作用です。BioStar サーバーにログとして記録され、認証の成功／失敗、ドア状態の変化、警報、アラームなどがあります。"},"dual_auth":{"name":"デュアル認証","description":"制限時間内に異なる二人のクレデンシャルを順番に入力する認証方式です。"},"auth":{"name":"認証","description":"ユーザーが入力したクレデンシャルを検証して本人を判別する動作です。"},"auth_mode":{"name":"認証モード","description":"認証に必要なクレデンシャルの組み合わせです。"},"interlock_zone":{"name":"インターロック区域","description":"2つ以上の出入口扉の間にある空間で、一方の扉が開いているまたは解錠されている間は他の扉が施錠される区域です。"},"intercom":{"name":"インターホン","description":"建物または組織内で私設構内交換機（PBX）を利用して構築した通話システムです。"},"batch_enrollment":{"name":"一括登録","description":"複数の入退室カードをBioStarサーバーに登録することで、登録されたカードは個々のユーザーに割り当てることができます。"},"dst":{"name":"夏時間（Daylight Saving Time, DST）","description":"夏季に昼間時間を効率的に活用するため、標準時より時計を一定時間進める制度です。主に省エネルギーと生産性向上を目的に実施されます。サマータイムとも呼ばれ、主に3月最終日曜日から10月最終日曜日まで実施されます。"},"io_device":{"name":"入出力デバイス","description":"情報の入出力機能を行うデバイスです。"},"lock":{"name":"ロック装置","description":"入退室管理システムと接続され、ドアを施錠するために使用される電子デバイスです。ドアに内蔵または取り付けられた電子装置を総称します。"},"held_open":{"name":"長時間ドア開放","description":"ドアが所定時間を超えて開いたまま放置されている状態です。アラームイベントを発生させるトリガーとなります。"},"device":{"name":"デバイス","description":"BioStarで制御できる入退室管理デバイスです。"},"device_id":{"name":"デバイスID","description":"BioStarで各ハードウェアデバイスを一意に識別するために付与される数値ベースの識別子です。"},"restart":{"name":"再起動","description":"デバイス動作中にプログラム実行に問題が発生した際、電源を完全に切ってから再投入する行為です。"},"ble":{"name":"Bluetooth Low Energy（BLE）","description":"約10m程度の距離で2.4GHz帯を利用し、低電力・小容量のデータを送受信できるBluetooth技術です。消費電力が非常に少ないため、電源供給が限られる小型デバイスで主に使用され、入退室管理分野でもモバイルIDカードとして活用されています。"},"cde":{"name":"適合性判定エンジン（Conformance Decision Engine, CDE）","description":"Supremaの指紋照合アルゴリズムの手順の一つで、指紋画像を処理して特徴点を抽出する前に、正しい指紋画像が取得されたかどうかを判断する段階です。"},"contact_card":{"name":"接触式カード","description":"表面に金色または銀色のチップが付いたカードです。データ送信のため、カード端末にチップが直接接触するように挿入する必要があります。"},"termination":{"name":"終端抵抗","description":"RS-485通信で反射を防ぎ信号品質を維持するため、デイジーチェーンの末端に接続する抵抗です。通信エラーを減らし、安定したデータ伝送を保証します。"},"intelligent_reader":{"name":"インテリジェントリーダー","description":"ユーザー情報や入退室情報を保存し、入力されたクレデンシャルを認証してユーザーの入室を許可できるデバイスです。"},"fp":{"name":"指紋","description":"指先の節にある曲線状の模様です。"},"fp_sensor":{"name":"指紋センサー","description":"指紋認識技術で指紋画像を取得する装置です。人それぞれ固有の指紋特徴を読み取り、デジタルデータへ変換します。指紋スキャナーで指を置く部分も含みます。"},"fp_scanner":{"name":"指紋スキャナー","description":"ユーザーの指紋をデータベースへ登録するために指紋をスキャンする装置です。"},"fp_recognition":{"name":"指紋認識","description":"指紋に含まれる固有の特徴点を分析して個人の身元を確認する技術です。指紋認識は指先の隆線や分岐点を基にデータを比較し、認証または識別に利用します。"},"fp_scan_timeout":{"name":"指紋入力タイムアウト","description":"指紋情報の入力制限時間です。"},"fp_template":{"name":"指紋テンプレート","description":"指紋画像に見られる隆線の端点や分岐点など、一連の微細な特徴点をまとめた指紋情報です。特徴点の位置と数を比較して識別に利用します。"},"stp":{"name":"シールドツイストペア","description":"外部ノイズを遮断し電気信号の干渉を低減するため、シールドで覆ったケーブルです。ノイズが多い工場や屋外、あるいは高速通信が必要な場所で主に使用されます。"},"clean_room":{"name":"クリーンルーム","description":"ほこり、ウイルス、金属粉、細胞など空気中の浮遊粒子を必要に応じて制御できる空間です。"},"initialize_reset":{"name":"初期化","description":"ハードウェアまたはソフトウェアの設定などを指定した初期値に戻す動作です。"},"mtu":{"name":"最大転送単位（Maximum Transmission Unit, MTU）","description":"ネットワークで送信できる最大パケットサイズです。"},"msb":{"name":"最上位ビット（Most Significant Bit, MSB）","description":"2進データで最も高い桁（最も左側）のビットまたはその値です。最下位ビット（Least Significant Bit, LSB）と対比される用語です。"},"lsb":{"name":"最下位ビット（Least Significant Bit, LSB）","description":"2進データで最も低い桁（最も右側）のビットまたはその値です。最上位ビット（Most Significant Bit, MSB）と対比される用語です。"},"punch_in":{"name":"出勤記録","description":"出勤時間を記録する動作です。"},"output_relay":{"name":"出力リレー","description":"他のデバイスに影響を与えるため、電気的接点を開閉する電子制御装置です。"},"access":{"name":"入退室","description":"特定の区域または資産へアクセスする行為です。"},"access_rule":{"name":"出入ルール","description":"特定のドア／ドアグループに、定められたスケジュールに従って出入できるルールです。"},"access_group":{"name":"アクセスグループ","description":"指定されたドア／ドアグループに、指定されたスケジュールで出入できる権限を持つユーザーグループです。"},"access_level":{"name":"入退室レベル","description":"指定したスケジュールの間、ドアに出入できる権利です。"},"entrance_limit_zone":{"name":"入退室制限エリア","description":"特定の時間帯に入退室を制限するエリアです。認証または認証回数を制限する方法で構成できます。"},"access_control":{"name":"入退室管理","description":"許可されていない人物が設備や資産にアクセスすることを制限するポリシーです。許可された人物の場合はログとして記録を作成します。"},"door":{"name":"ドア","description":"入退室制御のために物理デバイスが設置される場所で、入退室制御の基礎となる空間的概念です。"},"door_group":{"name":"ドアグループ","description":"管理を容易にするためのドアの集合で、ドアグループ単位でイベントを監視できます。入退グループの基本構成要素です。"},"door_sensor":{"name":"ドアセンサー","description":"ドアの状態を検知するセンサーです。開、閉、開放、強制開放などの状態を確認できます。"},"card":{"name":"カード","description":"携帯可能なカード型の情報媒体で、身分証明用の情報が保存されています。"},"card_id":{"name":"カードID","description":"企業や組織、部門で定義された形式に基づいて付与されるカードの固有番号です。カード ID は、カードメーカーが付与した固有番号、または特定の企業・組織が定義した形式の番号である場合があります。"},"card_layout":{"name":"カードレイアウト","description":"カード内データの配列および構造です。"},"card_mode":{"name":"カードモード","description":"カード所持者を認証する方法として、<b>カード ID モード</b>と<b>テンプレート・オン・カード モード</b>の 2 つがあります。<b>カード ID モード</b>はカードに保存されたカード ID を基準に、デバイスに保存されたユーザー ID と指紋情報を照合します。一方、<b>テンプレート・オン・カード モード</b>はユーザーが入力した指紋とカード内の指紋情報が一致するかを確認して本人を認証します。"},"csn":{"name":"カードシリアル番号（Card Serial Number、CSN）","description":"メーカーが割り当てたカードの固有番号です。"},"card_reader":{"name":"カードリーダー","description":"カードに保存された情報を読み取り、コントローラーへ送信する装置です。"},"kernel":{"name":"カーネル（Kernel）","description":"オペレーティングシステムの中核部分で、メモリやプロセスなどの重要なリソースを管理し、起動時にメモリへロードされて各種基本サービスを提供します。"},"controller":{"name":"コントローラー（Controller）","description":"リーダーで取得したクレデンシャル情報を用いて入退室権限を判定し、リーダーの入出力を制御する装置です。"},"credential":{"name":"クレデンシャル（Credential）","description":"ユーザーの身元を確認するためのデータです。一般的にはデジタル署名、スマートカード、生体情報、ユーザー名とパスワードなどがあります。"},"client":{"name":"クライアント（Client）","description":"ネットワークを介してサーバーにサービスを要求する主体です。"},"far":{"name":"他人受入率（誤受入率、False Acceptance Rate、FAR）","description":"生体認証システムの精度を比較する際に用いる指標で、未登録者を登録者として誤認する確率です。"},"transaction":{"name":"トランザクション（Transaction）","description":"データベースに対する検索や更新操作などで構成される処理の基本単位です。更新によって一時的に不整合なデータが使用されないよう、一括して処理します。トランザクションが満たすべき技術的要件には<a href=\'#acid\'>ACID 特性</a>があります。"},"tamper":{"name":"タンパー（Tamper）","description":"デバイス状態を監視する方法の一つで、外的要因によりデバイスが取り付けブラケットから外れると警報を鳴らしたり、サーバーにイベントを記録したりするよう設定できます。"},"tailgating":{"name":"テイルゲーティング（Tailgating）","description":"不正認証を利用した侵入方法の一つで、制限区域へのアクセス権がない人物が前の人物に続いて侵入する行為です。「2 人同時通過」とも呼ばれ、<b>ピギーバッキング（Piggybacking）</b>と並んで代表的な不正侵入方法です。一般に、<b>テイルゲーティング（Tailgating）</b>は意図しない不正侵入を、<b>ピギーバッキング（Piggybacking）</b>は意図的な不正侵入を指します。"},"template":{"name":"テンプレート（Template）","description":"生体特徴を抽出して符号化し保存したデータで、生体認証システムまたはデバイスでユーザーが入力した生体サンプルと比較し、身元確認に用います。"},"template_on_card":{"name":"テンプレート・オン・カード（Template on Card）","description":"ユーザー情報および指紋テンプレートを保存できるスマートカードです。"},"punch_out":{"name":"退勤記録","description":"退勤時刻を記録する行為または動作です。"},"exit_button":{"name":"退室ボタン","description":"ドアを開けるためのボタンです。このボタンを押すとドアが開き、追加認証が不要なドアやエリアで使用できます。"},"trigger_action":{"name":"トリガーアクション（Trigger action）","description":"アラームや特定イベントが発生した際に、自動でデバイスを制御したりメール送信などを行います。"},"minutiae":{"name":"特徴点","description":"指紋認識に用いられる隆線の微細な特徴要素です。"},"tilting_bracket":{"name":"ティルティングブラケット（Tilting bracket）","description":"角度調整が可能なブラケットで、顔認証デバイスや虹彩認証デバイスに主に使用されます。"},"firmware":{"name":"ファームウェア（Firmware）","description":"製品のハードウェアを制御するために ROM に保存されたマイクロプログラムおよびファイルです。"},"port_number":{"name":"ポート番号（Port Number）","description":"TCP/UDP で相互通信するために使用するポート番号です。範囲は 0〜65535 です。"},"timezone":{"name":"標準タイムゾーン","description":"同一時間を使用する地理的区域です。入退室制御のため、デバイスや BioStar の時間設定に使用します。"},"protocol":{"name":"プロトコル（Protocol）","description":"システムまたは端末間でデータを交換する際に使用する通信規則です。"},"piggybacking":{"name":"ピギーバッキング（Piggybacking）","description":"不正認証を利用した侵入方法の一つで、制限区域へのアクセス権がない人物が意図的にアクセス権を持つ人物と一緒に侵入する行為です。「Piggybacking」または「Piggyback」とも呼ばれ、<b>テイルゲーティング（Tailgating）</b>と並んで代表的な不正侵入方法です。一般に、<b>ピギーバッキング（Piggybacking）</b>は意図的な不正侵入を、<b>テイルゲーティング（Tailgating）</b>は意図しない不正侵入を指します。"},"bypass_card":{"name":"常時通過カード","description":"認証手続きをバイパスして特定エリアにアクセスできるカードです。たとえば、このカードを所持する人物は一連のセキュリティ（認証）手続きを経ずにドアを通過できます。"},"grace":{"name":"猶予時間","description":"勤怠規則における猶予時間です。例えば、出勤時刻を9時、猶予時間を10分に設定した場合、9時から9時10分の間に出勤しても遅刻とは扱われません。"},"duress":{"name":"脅迫指紋","description":"指紋登録時に特定のイベントを発生させるために指定する指紋です。その指紋で認証すると、ログに脅迫指紋認証として記録され、管理者はこのログを利用して別途アラームを設定できます。"},"fire_alarm_zone":{"name":"火災警報ゾーン","description":"火災発生時にすべての出入口またはエレベーターが開放または施錠されるように設定されたゾーンです。"},"vacation":{"name":"休暇","description":"あらかじめ定められた理由または許可を得て勤務を休むこと、またはその期間です。"},"break":{"name":"休憩","description":"勤務時間中に業務を一時中断して休む行為です。休憩開始から終了までの時間で計算します。"}}')
