var faqs_namespaceObject = JSON.parse('[{"category":{"title":"전원","hid":"power","contents":[{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"전원이 공급되고 있으나 작동하지 않습니다.","answer":["단말기와 브래킷이 떨어져 있으면 탬퍼 스위치에 의해 작동하지 않을 수도 있습니다.","어댑터 또는 전원 연결 케이블을 확인하세요."]}]}},{"category":{"title":"PIN","hid":"pin","contents":[{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"PIN을 분실했습니다.","answer":["일반 사용자의 PIN은 관리자에게 요청한 뒤 다시 입력하세요.","관리자 PIN 분실 시 설치 업체에 문의하세요."]},{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"PIN을 입력한 뒤 <span class=\'cmd\'>OK</span> 버튼을 눌러도 잠긴 문을 열 수 없습니다.","answer":["등록한 PIN을 정상적으로 입력하였는지 확인하세요.","최근에 PIN을 변경하지 않았는지 확인하세요.","PIN을 알 수 없는 경우 관리자에게 요청한 뒤 다시 입력하세요."]}]}},{"category":{"title":"QR/바코드","hid":"qrbarcode","contents":[{"product":["xstation_2"],"question":"QR/바코드 인식이 잘 되지 않습니다.","answer":["<a href=\'getting-started#how-to-scan-qrbarcode\'>올바른 QR/바코드 인증 방법</a>을 확인한 뒤 다시 시도하세요.","<b>XS2-QDPB</b>, <b>XS2-QAPB</b>: 가이드 빔이 QR/바코드의 중앙에 오도록 위치시키세요.","<b>XS2-DPB</b>, <b>XS2-APB</b>, <b>XS2-ODPB</b>, <b>XS2-OAPB</b>: QR/바코드를 장치의 스캔 화면 중앙에 오도록 위치시키세요.","모바일 장치에 내려 받은 QR/바코드일 경우 화면이 잘 보이도록 모바일 장치의 밝기를 조정하거나 화면을 닦고 다시 시도하세요.","문제가 해결되지 않을 경우 QR/바코드를 발급한 관리자에게 문의하세요."]},{"product":["biostation_3_max"],"question":"QR/바코드 인식이 잘 되지 않습니다.","answer":["<a href=\'getting-started#how-to-scan-qrbarcode\'>올바른 QR/바코드 인증 방법</a>을 확인한 뒤 다시 시도하세요.","모바일 장치에 내려 받은 QR/바코드일 경우 화면이 잘 보이도록 모바일 장치의 밝기를 조정하거나 화면을 닦고 다시 시도하세요.","문제가 해결되지 않을 경우 QR/바코드를 발급한 관리자에게 문의하세요."]}]}},{"category":{"title":"얼굴","hid":"face","contents":[{"product":["biostation_3","facestation_f2","facestation_2","biostation_3_max"],"question":"등록은 되었으나 얼굴 인증이 잘 되지 않고 오류가 많이 납니다.","answer":["<a href=\'getting-started#cautions-enrolling-faces\'>얼굴 등록 시 주의 사항</a>을 확인한 뒤 얼굴을 다시 등록하세요.","등록된 얼굴 개수가 많다면 <span class=\'cmd\'>매칭 대기 시간</span>을 변경한 뒤 다시 시도하세요."]},{"product":["biostation_3","facestation_f2","facestation_2","biostation_3_max"],"question":"갑자기 얼굴 인증이 되지 않습니다.","answer":["<a href=\'getting-started#cautions-authenticating-face\'>얼굴 인증 시 주의 사항</a>을 확인한 뒤 다시 시도하세요."]},{"product":["biostation_3","facestation_f2","biostation_3_max"],"question":"<span class=\'cmd\'>마스크 검출</span> 기능을 <span class=\'cmd\'>사용</span>으로 설정하였으나 마스크 착용 시 얼굴 인증이 잘 되지 않고 오류가 많이 납니다.","answer":["마스크를 코끝까지 내리고 얼굴을 2회 인증한 뒤 다시 코를 덮고 얼굴 인증을 시도하세요. 문제가 지속될 경우 설치 업체에 문의하세요."]},{"product":["facestation_f2","facestation_2"],"question":"열화상 카메라 사용 시 온도가 정상적으로 측정되지 않습니다.","answer":["단말기에 열화상 카메라가 정상적으로 연결되었는지 확인하세요.","이마가 가려지지 않은 상태에서 온도 측정을 다시 시도하세요. 문제가 지속될 경우 설치 업체에 문의하세요."]},{"product":["facestation_f2","facestation_2"],"question":"열화상 카메라 사용 시 온도가 너무 낮게 측정됩니다.","answer":["동절기에 사용자가 장시간 동안 실외의 낮은 온도에 노출된 상태에서 온도를 측정할 경우 체온보다 낮게 측정될 수 있습니다. 실내에서 1~2분 대기한 뒤 다시 시도하세요. 문제가 지속될 경우 설치 업체에 문의하세요."]}]}},{"category":{"title":"지문","hid":"fingerprint","contents":[{"product":["bioentry_n2","biostation_2a","biolite_n2","xstation_2","facestation_f2","biostation_3_max"],"question":"등록은 되었으나 지문 인식이 잘 되지 않고 오류가 많이 납니다.","answer":["<a href=\'getting-started#cautions-enrolling-fingers\'>올바른 지문 입력 방법</a>을 확인한 뒤 지문을 다시 등록하세요.","지문에 상처가 생기는 경우 기기는 다른 사람의 지문으로 잘못 인식될 수 있습니다.","등록된 지문 개수가 많다면 <span class=\'cmd\'>매칭 대기 시간</span>을 변경한 뒤 다시 시도하세요.","지문마다 특징의 차이로 인해 인식률에 차이가 있으니 다른 손가락의 지문을 등록하세요."]},{"product":["bioentry_n2","biostation_2a","biolite_n2","xstation_2","facestation_f2","biostation_3_max"],"question":"갑자기 지문 인식이 되지 않습니다.","answer":["손가락이나 지문 센서에 땀, 물기, 먼지 등이 묻어 있는지 확인한 뒤 깨끗이 닦아 주세요.","마른 수건 등으로 손가락과 지문 센서를 닦은 다음 다시 시도하세요.","손가락의 지문이 매우 건조할 때는 입김을 분 다음 다시 시도하세요."]},{"product":["bioentry_n2","biostation_2a","biolite_n2","xstation_2","facestation_f2","biostation_3_max"],"question":"지문 센서가 켜지지 않습니다.","answer":["<span class=\'cmd\'>센서 모드</span>가 <span class=\'cmd\'>자동 켜짐</span>으로 설정되어 있을 경우 지문 센서에 손가락을 댈 경우에만 센서가 켜집니다. 항상 지문 센서가 켜져 있길 원한다면 <span class=\'cmd\'>센서 모드</span>를 <span class=\'cmd\'>항상 켜짐</span>으로 설정하세요."]}]}},{"category":{"title":"문 잠금","hid":"doorlock","contents":[{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"문을 닫아도 잠금 장치는 잠기지 않습니다.","answer":["전기 잠금 장치의 이상일 수 있습니다. 설치 업체를 통해 점검을 받으세요."]}]}},{"category":{"title":"시간","hid":"time","contents":[{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"갑자기 시간이 맞지 않습니다.","answer":["장치에는 내장 배터리가 있으나, 오랫동안 전원이 공급되지 않으면 내장 배터리가 방전되어 시간이 달라질 수 있습니다. <a href=\'settings#date-time\'>날짜와 시간</a> 메뉴를 참고하여 시간을 수정할 수 있습니다."]}]}},{"category":{"title":"관리자 접속","hid":"admin","contents":[{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"관리자 PIN을 분실하여 관리자 모드에 진입할 수 없습니다.","answer":["장치는 관리자가 출입 허용 권한을 부여하기 때문에 관리자만 메뉴에 진입할 수 있습니다.","관리자 PIN 분실 시 설치 업체에 문의하세요."]}]}},{"category":{"title":"마스터 관리자","hid":"admin","contents":[{"product":["biostation_3","biolite_n2","biostation_2a","xstation_2"],"question":"기존 장치에서 펌웨어 업그레이드 후 마스터 관리자 설정이 보이지 않습니다.","answer":["기존 장치에서 펌웨어 업그레이드한 장치는 마스터 관리자 설정이 제공되지 않습니다. <span class=\'cmd\'>관리자 2단계 인증</span> 옵션을 통해 전체 관리자의 권한을 강화하여 장치의 보안을 향상시킬 수 있습니다. 자세한 내용은 <a href=\'settings#admin-2-step-authentication\'>관리자 2단계 인증</a> 옵션을 참조하세요."]}]}}]')
;// CONCATENATED MODULE: ./i18n/en/faqs.json
var en_faqs_namespaceObject = JSON.parse('[{"category":{"title":"Power","hid":"power","contents":[{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"The power is being supplied but the device does not operate.","answer":["If the terminal and the bracket are far away from each other, the device may not operate due to the temper switch.","Check the adaptor or the power cable."]}]}},{"category":{"title":"PIN","hid":"pin","contents":[{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"I lost my PIN.","answer":["For a normal user PIN, request it from the administrator and enter it again.","If you have lost the Admin PIN, contact the installation company."]},{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"I entered my PIN and pressed the <span class=\'cmd\'>OK</span> button, but I still cannot open the door.","answer":["Check if you have entered the registered PIN correctly.","Check if you have changed the PIN recently.","If you cannot remember the PIN, request it from the administrator and enter it again."]}]}},{"category":{"title":"QR/Barcode","hid":"qrbarcode","contents":[{"product":["xstation_2"],"question":"It fails to scan a QR/Barcode.","answer":["Refer to <a href=\'getting-started#how-to-scan-qrbarcode\'>Correct QR/Barcode Authentication Method</a> and try again.","<b>XS2-QDPB</b>, <b>XS2-QAPB</b>: Place the guide beam at the center of the QR code.","<b>XS2-DPB</b>, <b>XS2-APB</b>, <b>XS2-ODPB</b>, <b>XS2-OAPB</b>: Position the QR/Barcode in the center of the scan screen of the device.","Adjust the brightness of your smartphone so that the device can read the QR/Barcode clearly and try again.","If the problem persists, contact the administrator who issued the QR/Barcode."]},{"product":["biostation_3_max"],"question":"It fails to scan a QR/Barcode.","answer":["Refer to <a href=\'getting-started#how-to-scan-qrbarcode\'>Correct QR/Barcode Authentication Method</a> and try again.","Adjust the brightness of your smartphone so that the device can read the QR/Barcode clearly and try again.","If the problem persists, contact the administrator who issued the QR/Barcode."]}]}},{"category":{"title":"Face","hid":"face","contents":[{"product":["biostation_3","facestation_f2","facestation_2","biostation_3_max"],"question":"The face has been registered but face authentication cannot be done smoothly, and errors occur frequently.","answer":["Check <a href=\'getting-started#cautions-enrolling-faces\'>Cautions for enrolling a faces</a> and enroll the face again.","If there is a large number of enrolled faces, change <span class=\'cmd\'>Matching Timeout</span> and try again."]},{"product":["biostation_3","facestation_f2","facestation_2","biostation_3_max"],"question":"Face authentication has suddenly stopped working.","answer":["Check <a href=\'getting-started#cautions-authenticating-face\'>Cautions for authenticating a face</a> and try again."]},{"product":["biostation_3","facestation_f2","biostation_3_max"],"question":"<span class=\'cmd\'>Mask Detection</span> is set to <span class=\'cmd\'>Enabled</span>, but face authentication cannot be done smoothly when wearing a mask.","answer":["Authenticate your face twice with the mask pull down on the tip of your nose. Then, authenticate your face again wearing a mask that covers your nose completely. If the problem persists, contact the installation company."]},{"product":["facestation_f2","facestation_2"],"question":"The thermal camera fails to measure temperature.","answer":["Check if the thermal camera is properly connected to the terminal.","Measure the temperature again without covering your forehead. If the problem persists, contact the installation company."]},{"product":["facestation_f2","facestation_2"],"question":"The thermal camera measures lower temperature than actual temperature.","answer":["If a user measures the temperature after being exposed to cold temperatures for a long time, the temperature may be measured lower than the actual temperature. Wait for 1 to 2 minutes indoors and try again. If the problem persists, contact the installation company."]}]}},{"category":{"title":"Fingerprint","hid":"fingerprint","contents":[{"product":["bioentry_n2","biostation_2a","biolite_n2","xstation_2","facestation_f2","biostation_3_max"],"question":"The fingerprint has been enrolled but fingerprint authentication cannot be done smoothly and errors occur frequently.","answer":["Check <a href=\'getting-started#cautions-enrolling-fingers\'>How to enroll a fingerprint</a> and enroll the fingerprint again.","If your fingerprint has a cut, the device may recognize your fingerprint as someone else\'s fingerprint.","If there are a large number of enrolled fingerprints, change <span class=\'cmd\'>Matching Timeout</span> and try again.","The authentication rate may vary for each fingerprint due to different characteristics. Enroll the fingerprint of another finger."]},{"product":["bioentry_n2","biostation_2a","biolite_n2","xstation_2","facestation_f2","biostation_3_max"],"question":"Suddenly fingerprint authentication cannot be done.","answer":["Check if the finger or the fingerprint sensor is smeared with sweat, water or dust, and wipe the finger or the fingerprint sensor clean.","Wipe your finger and the fingerprint sensor with a dry towel and then try again.","If the fingerprint of your finger is too dry, blow on the fingerprint and then try again."]},{"product":["bioentry_n2","biostation_2a","biolite_n2","xstation_2","facestation_f2","biostation_3_max"],"question":"The fingerprint sensor does not turn on.","answer":["When <span class=\'cmd\'>Sensor Mode</span> is set to <span class=\'cmd\'>Auto On</span>, the sensor will only turn on when you place finger on the fingerprint sensor. If you want the fingerprint sensor to always be on, set <span class=\'cmd\'>Sensor Mode</span> to <span class=\'cmd\'>Always On</span>."]}]}},{"category":{"title":"Door lock","hid":"doorlock","contents":[{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"The door cannot be locked when I close the door.","answer":["The electric lock may be malfunctioning. Have an inspection through the installation company."]}]}},{"category":{"title":"Time","hid":"time","contents":[{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"Suddenly the time has become incorrect.","answer":["The device is equipped with a built-in battery but if power is not supplied for a long time, the built-in battery may die, causing the time to become incorrect. You can correct the time by referring to <a href=\'settings#date-time\'>Date & Time</a>."]}]}},{"category":{"title":"Admin access","hid":"admin","contents":[{"product":["biostation_3","biostation_2a","facestation_f2","bioentry_n2","biolite_n2","facestation_2","xstation_2","biostation_3_max"],"question":"I lost my Admin PIN, so I cannot access the Admin mode.","answer":["The administrator grants an access permission in the device, so only the administrator can access the Admin menu.","If you have lost the Admin PIN, contact the installation company."]}]}},{"category":{"title":"Master Admin","hid":"admin","contents":[{"product":["biostation_3","biolite_n2","biostation_2a","xstation_2"],"question":"After upgrading the firmware on existing devices, the Master Admin setting does not appear.","answer":["Devices upgraded with firmware from existing devices do not support master administrator configuration. You can enhance device security by strengthening the permissions of all administrators through the <span class=\'cmd\'>Admin 2-Step Authentication</span> option. For more detailed information, refer to <a href=\'settings#admin-2-step-authentication\'>Admin 2-step Authentication</a>."]}]}}]')
